(3536, 3366, '/avtar/cb03f5b8-e31d-4bf3-a808-79caa44360252.jpg', ' प.पू.महत्तरा पद विभूषिता श्रीचम्पाश्री.म.सा ', 0, '', 38, 0, '00:00:00', '', '0000-00-00', NULL, NULL, NULL, 'आज पूज्य गुरूवर्याश्रीजी की पुण्यतिथि पर उनकी जीवनी की एक नज़र.. भादवा सुदी 9 ता: 27/08/2020 गुरुवार खरतरगच्छीय प.पू. प्रवर्तिनी श्रीपुण्यश्रीजी.म.सा की शिष्या जैन जगत की विरल विभूति गुरूवर्या ,समुदायध्यक्षा,शतायुसंम्पना प.पू.महत्तरा पद विभूषिता श्रीचम्पाश्री.म.सा की 32वीं पुण्यतिथि तिथि भादवा सुदी 9 याद आवे गुरूवर्या तुम्हारी सावन बहाएं आँखे हमारी अर्पित करतते है श्रद्धा क्यारी दर्शन प्यासे भक्त तुम्हारे थी निराली शक्ति तुम्हारी तेरे गुण की है बलिहारी सदा शांति पाए आत्मा तुमारी यही श्रद्धांजली सदा हमारी प.पू.महत्तरा पद विभूषिता श्रीचम्पाश्री जी.म.सा की जीवन झांकी जन्म -वि.स.1942कार्तिक 4 गांव -चाखूगांव (जिला-जोधपुर -राज)_ माता - मूलीदेवी पिता - गोरखचन्दजी जन्म नाम -चंदाकुमारी संयम निश्रा -प.पू.प्र.पुण्य शिशु साध्वी श्रीसुवर्णश्रीजी.म.सा दीक्षा संवत- 1961मिगसर सुदी 5 खीचन (जिला- जोधपुर) दीक्षा नाम - प.पू. चम्पाश्रीजी.म.सा गुरूवर्या - प.पू.प्रवर्तिनी श्रीपूण्यश्रीजी.म.सा शतायु अभिनदंन - गढ़ सिवाना 2040 वैशाख सुदी 8 महत्तरापद विभूषित - गढ़ सिवाना 2043माघ सुदी 14 स्वर्गवास तिथि - गढ़सिवाना वि.स.2045 भादवा सुदी 9 दीक्षा प्रर्याय- 85वर्ष आयु 105 वर्ष_ समाधि स्थल - चम्पावाड़ी स्मारक ट्रस्ट ,गढ़सिवाना (जिला-बाड़मेर -राजस्थान)', '', 0, NULL, 0, NULL, '1883-08-27', '', '2023-08-09 12:17:11', '2023-08-09 12:17:11'),
