(5, 7, 5, NULL, '/news_banner/143579855613353lavji_badshah.jpeg', 'Viral', '2022-11-24', 'आपने अंग्रेजी से हिंदी कनवर्टर के साथ जो टाइप किया है वह यूनिकोड फ़ॉन्ट में है, इसलिए यह बहुत पोर्टेबल है जिसका मतलब है कि आप डिजिटल दुनिया में कहीं भी इस हिंदी पाठ का उपयोग कर सकते हैं। आप यहां से कॉपी करके फेसबुक, व्हाट्सएप, ट्विटर, ब्लॉग्स, किसी भी साइट के कमेंट सेक्शन में पेस्ट कर सकते हैं। आप हिंदी पाठ को या तो नोटपैड फ़ाइल (.txt प्रारूप) या दस्तावेज़ फ़ाइल (एमएस वर्ड) के रूप में डाउनलोड कर सकते हैं।  यदि आप अपनी टाइप की गई सामग्री का फ़ॉन्ट बदलना चाहते हैं तो दो विकल्प हैं। सबसे पहले आप अपने हिंदी टेक्स्ट को एएनएसआई हिंदी फॉन्ट जैसे \"कृतिदेव\" या \"डेविल्स\" में यूनिकोड से क्रुतिदेव कन्वर्टर टूल में बदल सकते हैं। दूसरा विकल्प आप अपने सिस्टम में डाउनलोड करने के बाद फॉन्ट बदल सकते हैं। डाउनलोड करने के बाद एमएस वर्ड या नोटपैड के साथ हिंदी टेक्स्ट खोलें और फॉन्ट परिवार बदलें। आप हमारी वेबसाइट के डाउनलोड मेन्यू से हिंदी यूनिकोड फोन्ट डाउनलोड कर सकते हैं।', '2022-11-24 05:41:52', '2023-02-17 14:11:57', 5, 1, NULL, 0),
