(760, 9, 19, NULL, '/news_banner/1631351106RAJESH JASRAJJI SHRI SHRIMAL.jpg', 'स्व,राजेश सुपुत्र स्व श्री जसराजजी श्रीश्रीमाल', '2023-09-26', 'स्व,राजेश सुपुत्र स्व श्री जसराजजी श्रीश्रीमाल मरुधर में कानाना हाल हुबली उम्र 52 का स्वर्गवास 25/9/23 को हुबली में हुआ था उनका उठावना  ता 27/9/23 बुधवार को सुबह 11.00 बजे निवास स्थान से श्री शांतिनाथ जैन मन्दिर कंचगार गल्ली में  होगा निवास स्थान बलगानूर अप्पार्टमेन्ट रमेश भवन के सामने केशवापुर  *शोकाकुल परिवार अशोककुमार सुरेशकुमार गौतमचंद महावीरकुमार राजेंद्रकुमार दिलीपकुमार पारसमल मनोज रणजीत कमलेश हनुमानचन्द यश गौरव कुणाल विनीत कुशल श्रीश्रीमाल परिवार कानाना (हुबली सूरत गुंटकल) फर्म मणिभद्र एलेक्ट्रीक कम्पनी, ऋषब कॉस्मोक्स हुबली।', '2023-09-25 15:21:05', '2023-09-26 15:09:02', 0, 0, NULL, NULL),
