(768, 9, 22, NULL, '/news_banner/5822122ramesh jivrajji lukad.jpg', 'स्व,श्री रमेश कुमार जीवराजजी लुकड़', '2023-11-17', '<p>दिवगंत रमेशभाई लुंकड़ वो हमारे साथ मंडल से जुड़े हुए थे वो एक सक्रिय सदस्य ,व सरल व्यक्तितव के धनी थे।और दादागुरुदेव के प्रति सदैव समर्पित,असीम श्रदा,तथा हमेशा तन- मन- धन से समर्पित श्रदांलु का अचानक जाना पूरे मंडल के लिए अत्यंत दुःखद तथा ह्रदय विदारक है ! वो खरतरगच्छाधिपति आचार्य प. पू मनिप्रभसुरिश्वरजी म. सा का सांसारिक अनुज थे ! हुबली संघ हुबली ने एक सुश्रावक खो दिया है जिसकी पूर्ति नहीं हो सकती!विधि की विडंबना के आगे हम सभी नतमस्तक है! ईश्वर उसकी आत्मा को शांति प्रदान करें तथा दादा गुरुदेव से प्रार्थना है कि परिवार को दुःख सहन करने की शक्ति प्रदान करे !</p>\r\n<p style=\"text-align: center;\"><br><em><strong>जिनकुशल युवा मंच&nbsp; खरतरगच्छ युवा परिषद&nbsp; &nbsp;JYM सेवा समिति</strong></em></p>', '2023-11-17 10:11:47', '2023-11-17 10:11:58', 0, 1, NULL, NULL),
