(351, NULL, 'LODERVAJI TIRTH@ JASLMER', '9549438485', NULL, '8 km from Jaisalmer Railway Station, Lodurva is a village in Jaisalmer district of Rajasthan. Famous for Jain temples', '105', '19', '451', 'Today, it is a popular tourist destination, known for its architectural ruins and surrounding sand dunes.[7] Apart from that Ludrawa is also famous for the Jain temple dedicated to 23rd Tirthankara, Parshvanatha destroyed in 1152 AD when Muhammad Ghori sacked the city but was reconstructed in 1615 by Seth Tharu Shah and further additions were commissioned in 1675 and 1687.[8] The temples were rebuilt in the late 1970s, are reminders of the city\'s former glory.[9] Rishabhanatha Temple and Sambhavanatha Temple are also major attraction. Other places are Hinglaj mata temple, Chamunda mata temple, and old temple of Shiva.', '2023-08-19 14:09:31', '2023-08-19 14:09:31', 0, 0, NULL, NULL, 15, 27),
