(357, '/utilites_banner/1267581816201_thumbnail.jpg', 'Parsvamani Jain Tirth PeddaTumbalam', '8512257432', '9866119698', 'Parshwamani Jain Tirth Peddatumbalam PADDATULAM ADONY', '105', '1', '922', 'आज से 60 वर्ष पर्व आंद्र प्रदेश के पेददतुम्बलम गाव मे कुएँ  की खुदाई के समय 12 शताब्दी पुर्व  ( करीबन 2000 वर्ष पुरानी )भगवान पार्श्वनाथ की अलौकिक प्रतिमा प्रकट हुई है , साथ में महावीरस्वामी , शांतिनाथ प्रभु चोबीशी, पद्मावती देवी की अक्षत, मनोरम , यह दिव्य प्रतीमाये भी प्राप्त हुई है  ।\r\nगाव मे भगवान प्रकट होने के बाद बहोत चमत्कार ,  प्रगती , समृध्दि, व्यापार वृद्धि , सुखशान्ती  निर्माण होने से गाव वाले नित्य भगवान की पुजापाठ करने लगे व प्रतिमा जैन संघ को देने से मना करते रहे , \r\nखरतरगच्छीय  साध्वी प, पु, सुलोचनाश्रीजी  , साध्वी  सुलक्षणाश्रीजी के चेन्नई चातुर्मास मे एक दिन स्वप्न मे उनके हातो से एक महान तीर्थ का निर्माण होगा यह संदेश देवी मार्फत हूआ,  तभी अदोनी संघ के श्रावको द्वारा पेददतुम्बलम मे  प्रतिमा प्रकट होने के घटना की जानकारी साध्वीजी को मिली , साध्वीजी ने भारत के  महान विधीकार मनोजजी हरण को प्रकट स्थल पर प्रतिमा देखने भेजा , प्रतिमा देखने पर  यहाँ तो तीर्थ रुप बने ऐसा मंदिर बनेगा ऐसा रिपोर्ट साध्वी को दी , \r\nदोनो साध्वीजी प्रकट स्थल पर पहुच ने पर अट्ठम तप की आराधना की व गाव वालोको मंदिर आपके गाव मे ही बनाने के शब्द दिया ,  गाव वालोने प्रतिमा जैन संघ को सौप ने का निर्णय किया ,\r\nप, पु, आचार्य जिनकांतीसागरसुरिश्वरजी मा, सा, के प्रेरणा से कार्य प्रारंम्भ हूआ , \r\nदि, 2 मार्च 2008 मे प, पु, उपाध्याय (हाल मे आचार्य )  मनिप्रभसागरजी मा, सा,  प, पु, पन्यासजी ( हाल मे आचार्य )  चंद्रजीतविजयजी मा, सा, पु, साध्वी श्री  सुर्यप्रभाश्रीजी मा, सा, , पूज्य साध्वी श्री हेमचन्द्राश्रीजी मा, सा, के सानिध्य मे प्रतिष्ठा  सम्पन्न हुई, \r\nआज करीबन  11  एकर मे यह विशाल तीर्थ बनाया गया है , वहा 162 रुम की धर्मशाला , भोजनशाला , विशाल उपाश्रय ,  आदी सुविधा है, तीर्थ पर हर पूनम को  500/ 600 आराधको का आवागमन होने लगा है , \r\nपक्षाल के समय तथा लाइट लगने पर पार्श्वनाथ भगवान के नाभि पर धरणेद्र देव के स्पस्ट रुप से दर्शन  तथा कई बार केशर वर्षा हुई है , ऐसे चमत्कारी प्रभु के दर्शन से लाखो भावीक अपने आप मे भाग्यशाली व आन्तरिक प्रसन्नता  महसूस करते है  , सभी ने एक बार  जरुर तीर्थ के दर्शन , सेवा पूजन का लाभ लेना चाहिए यह विनंती है ।\r\nश्री पार्श्वमणि  तीर्थ अदोनी रेल्वे स्टेशन से 21 किलो मिटर दुरी पर है ।आप सभी को यह ज्ञात कराते हुए बड़ा हर्ष हो रहा है कि विगत महीनों में कोरोना महामारी के कारण *श्री पार्श्वमणि तीर्थ पेद्दा तुम्बलम (अदोनी)* मंदिर जी मे पूजा,धर्मशाला,भोजनशाला इत्यादि बंद थे, किन्तु अब तीर्थ पर ये सभी व्यवस्थाएं पहले की तरह फिर से शुरू हो चुकी है। \r\nअतः आपश्री को सूचित किया जा रहा है कि अब आप निःसंकोच तीर्थ पर दर्शन-पूजा करने हेतु पधारे।\r\nनोट:- तीर्थ पर आने से पहले एक बार मोबाइल नम्बर 9866119698 पर अवश्य सूचित करे। निवेदक ट्रस्ट मंडल\r\nश्री पार्श्वमणि तीर्थ पेद्दा तुम्बलम (अदोनी)', '2023-08-20 12:14:36', '2023-08-20 12:14:36', 0, 0, NULL, NULL, 15, 27),
