(361, '/utilites_banner/55285832677_thumbnail.jpg', 'AJAHRA PARASWNATH JAIN TIRTH @ AJAHARA', '9825597927', '02875269355', 'Una-Junagadh', '105', '5', '924', 'BHOJAN SALA\r\n श्री अजाहरा पार्श्वनाथ\r\nश्री अजहरा पार्श्वनाथ – अजहराअयोध्या के सूर्यवंशी राजा की वंश परंपरा में अजयपाल नाम का राजा हुआ, जिसने साकेतपुर नगर को अपनी राजधानी बनाई थी|एक बार वह राजा शत्रुंजय महातीर्थ की यात्रा के लिए अपने नगर से निकल पड़ा| क्रमश: आगे बढ़ते हुआ वह दीव बन्दर में आया, तभी उसके शरीर में भयंकर व्याधि फ़ैल गई| इस कारण उसे वहीँ पर रुकना पड़ा|इसी बीच रत्नसार नामक व्यापारी के जहाज समुद्र के तूफ़ान में फंस गए| अपने प्राणों की रक्षा के लिए रत्नसार ने परमात्मा का ध्यान किया| परमात्म-ध्यान की रक्षा के लिए रत्नसार ने परमात्मा का ध्यान किया| परमात्म-ध्यान के प्रभाव से उसे उसी समय दिव्यवाणी सुनाई दी| दिव्य वाणी के संकेतनुसार कल्पवृक्ष के लकड़े के संपूत में रही पार्श्वनाथ प्रभु की प्रतिमा की जानकारी मिली| दैवी संकेत से उसे ख्याल आया की धर्नेंद्र ने इस प्रतिमा की ७ लाख वर्ष तक पूजा की है, कुबेर देव ने ६०० वर्ष तथा वरुणदेव ने ७ लाख वर्ष तक पूजा की है| अधिष्ठात्री पद्मावती देवी ने यह प्रतिमा अजयपाल राजा को सौपने की बात की|दैवी प्रभाव से रत्नसार ने समुद्र में से वह प्रतिमा प्राप्त की, उसी समय वह समुद्र भी शांत हो गया|रत्नसार ने अत्यंत ही आडंबर पूर्वक वह प्रतिमा अजयपाल राजा को प्रदान की| राजा ने प्रभुजी का भव्य स्नात्र मोहत्सव किया| उस स्नात्रजल के प्रभाव से राजा की व्याधि एकदम शांत हो गई| अजयपाल राजा ने वहां अजयनगर बसाया| वहां पर भव्य जिनमंदिर बनवाकर उसमे पार्श्वनाथ प्रभु की प्रतिष्ठा की|प्रभुजी की त्रिकाल-पूजा के प्रभाव से राजा की समृद्धि खूब बढ़ गई| छ मास बाद राजा ने शत्रुंजय महातीर्थ की यात्रा की|अजय राजा के रोग को हरनेवाले ये पार्श्वनाथ प्रभु अजहरापार्श्वनाथ के नाम से प्रख्यात हुए|४६ सें. मी. ऊँचे केसरवर्णीय सात फणावाले पद्मासन में सुशूभित ये पार्श्वनाथ प्रभु मन की मलिन वासनाओं को दूर करनेवाले है|यह अजाहरा तीर्थ जूनागढ़ (सौराष्ट्र) जिले में अजहारा तीर्थ जूनागढ़ (सौराष्ट्र) जिले में अजाहरा गाँव में आया हुआ है|', '2023-08-20 12:26:53', '2023-08-20 12:26:53', 0, 0, NULL, NULL, 15, 27),
(362, '/utilites_banner/132439575276_thumbnail.jpg', 'SHREE KALIKUND TIRTH @ DHOLKA', '9427030982', '02714225738', 'BAWLA KHEDA HIGHWAY ROAD KALIKUND DHOLKA-382225', '105', '5', '859', 'The Moolnayak idol, in the basement, is one of the idols belonged to Shri Kalikund Parshwanath Bhagwan, which were The temple is situated at Bhala Pol (Talghar) of Juna Mohalla iN Dholaka city.Yugpradhan Acharya Shri Jinduttsurishwarji was born at this holy place in VS 1132. He took Deeksha, leaving all normal livelihood of mankind in VS 1141, at the age of 9 years, from Shri Dharamdev Upadhyay. His contributions to Jainism will always be remembered in Jain history. Navangi Teekakar (critic) Shri Abhaydevsurishwarji, Shri Vadidevsurishwarji, Shri Jinchandrasurishwarji, Shri Chandraprabhsurishwarji and many other Acharyas has visited this place and done many religious works. Shri Jinchandrasurishwarji had started writing \"Akhyanmani-kosh\" here in Yashonagvasati and completed in Akshuptvasati. Yugpradhan Acharya Shri Jinduttsurishwarji was born at this holy place in VS 1132. He took Deeksha, leaving all normal livelihood of mankind in VS 1141, at the age of 9 years, from Shri Dharam Shri Tejpal Vastupal Charitable Trust Shri Tejpal Vastupal Charitable Trust; At & Post: Dholaka; Dist.: Ahmedabad; State: Gujarat (INDIA). Pin: 387 810. Telephone: (02714) 23738', '2023-08-20 12:30:27', '2023-08-20 12:30:27', 0, 0, NULL, NULL, 15, 27),
