(364, NULL, 'डूंगरपुर तीर्थ', '02964233259', '02964233186', 'श्री आदिनाथ भगवान जैन श्वेतांबर मंदिर पेढ़ी, मानेकचौक\r\nपो.ओ. डूंगरपुर - 314001\r\nजिला: डूंगरपुर, राजस्थान\r\nदूरभाष: 02964-33186/ 33259 (पीपी)', '105', '19', '444', 'इष्टदेव और स्थान:श्री आदिनाथ भगवान डूंगरपुर के मानेकचौक क्षेत्र के एक मंदिर में स्थित धात्विक \"परिकर\" में 105 सेमी ऊंचे सफेद रंग के कमल आसन में विराजमान हैं। :\r\nऐसा कहा जाता है कि विक्रम वर्ष 1526 में, इस मंदिर का निर्माण शेठ सांवलदास दावड़ा ने करवाया था और इसमें श्री आदिनाथ भगवान की एक बड़े आकार की धातु की मूर्ति स्थापित की गई थी और आचार्य श्री रत्नसूरिजी के शिष्यों श्री उदयवल्लभसूरिजी और श्री ज्ञानसागरसूरिजी के हाथों पवित्र किया गया था। मुस्लिम काल में मूर्ति को सोने की समझकर क्षतिग्रस्त कर दिया गया। इसलिए सफेद रंग की नई मूर्ति की प्राण-प्रतिष्ठा के बाद स्थापना की गई। हालाँकि धात्विक \"परिकर\" अभी भी बरकरार है जिस पर विक्रम वर्ष 1526 का एक शिलालेख है।मंदिर की विशेषता धातुई \"परिकर\" है  समें कुल 72 तीर्थंकरों की छवियां हैं - 24 अतीत, 24 वर्तमान और 24 भविष्य में। ऐसे फ्रेम वाली ऐसी ही मूर्ति दुनिया में कहीं और मिलना बेहद मुश्किल है। जिस पबासन पर भगवान विराजमान हैं वह भी धातु से बना है जिसमें 14 स्वप्न, 9 ग्रह, अष्टमंगल और यक्ष-यक्षिणियां देखी जा सकती हैं। इस मंदिर में 33 सेमी ऊंची श्री शांतिनाथ भगवान की एक मूर्ति भी है। स्फटिक पारदर्शी पत्थर से निर्मित और राजा संप्रति के काल के पांच धातुओं में ढले 34 जिनबिम्ब जो अत्यंत मनमोहक हैं।\r\nओसवाल राजवंश के बहादुर और बहादुर शेठ श्री शालाशा, राजा गोपीनाथ के मुख्यमंत्री और डूंगरपुर के सोमदास यहाँ रहते थे। स्थानीय \"भीलों\" को अपने अधीन कर शलाशा ने यहाँ विजय का जैन ध्वज लहराया था। वह न केवल बहादुर था, बल्कि धर्म प्रेमी और बहुत धर्मनिष्ठ भी था। उन्होंने विक्रम वर्ष 1312 में श्री पार्श्वनाथ भगवान का बहु-गुंबददार मंदिर बनवाया था जो आज पुराने घाटी मोहल्ले में मौजूद है। शालाशा के काल में डूंगरपुर एक बहुत बड़ा शहर था। तब जैन गृहस्थ परिवारों की संख्या 700 थी। वर्तमान में इसके अलावा छह मंदिर और हैं।यह तीर्थस्थल श्री केसरियाही से लगभग 42 किलोमीटर दूर है। अहमदाबाद-उदयपुर रोड पर भिचीवाड़ा से होकर पहुंचा जा सकता है, जहां बस और टैक्सियां ​​उपलब्ध हैं। डूंगरपुर का नजदीकी रेलवे स्टेशन 2 किलोमीटर दूर है। बस स्टैंड सिर्फ एक किमी दूर है.जैन तीर्थयात्रियों के लिए सुविधाएं:ठहरने के लिए पानी और बिजली की सुविधा सहित एक धर्मशाला है। पूर्व सूचना पर भोजन की व्यवस्था की जा सकती है', '2023-08-20 12:39:34', '2023-08-20 12:39:34', 0, 0, NULL, NULL, 15, 27),
