(366, '/utilites_banner/1898275326photo-91-151829-2.jpg', 'NAGAUR JAIN TIRTH', '01582241318', '01582242281', 'Jain Glass Temple is situated behind the Kamla Tower in Nagaur town of Rajasthan.', '105', '19', '455', 'Jain Glass Temple is situated behind the Kamla Tower in Nagaur town of Rajasthan. The whole temple is made of glass, and it is a unique shrine among all the Jain temples. The ceilings, floors, panels, pillars and doors of the shrine are adorned with beautiful enamel works. Tourists can see the attractive glass works inside the temple which represent the ancient art in the form of the Jain scriptures. The interiors of the temple are adorned with ornamental arches and beautiful marble works. This temple has different figures of Lord Mahavira apart from the statues of the other 23 Jain Tirthankaras.', '2023-08-20 13:19:16', '2023-08-20 13:23:14', 0, 0, NULL, NULL, 15, 27),
(367, '/utilites_banner/1747405783KesariyaJi-Rishabhdeo-Udaipur-11.jpeg', 'Shri Kesariyaji Rishabhdev Jain Tirth,', '02907230025', '02907230023', 'Address: Shri Kesariyaji Rishabhdev Jain Tirth, Rishabhdeo, District - Udaipur (Rajasthan)', '105', '19', '927', NULL, '2023-08-20 13:36:10', '2023-08-20 13:36:10', 0, 0, NULL, NULL, 15, 27),
(368, '/utilites_banner/77021716188143_sanderao1.jpg', 'मन्डार तीर्थ', '02975236131', NULL, 'श्री पंच महाजन जैन धर्मदा एवं धार्मिक ट्रस्ट भंडार\r\nपी.ओ. मंदार - 307513\r\nजिला: सिरोही, राजस्थान।\r\nफ़ोन: 02975 – 36131', '105', '19', '835', 'मंदार गांव में मंदिर शेरी के एक मंदिर में सफेद रंग में श्री महावीर भगवान, कमल मुद्रा में बैठे हैं और ऊंचाई 120 सेमी है।प्राचीनता और प्रमुख विशेषताएं:प्राचीन शिलालेखों में इस स्थान को महारुद या महाहद कहा गया है। महान प्रकांड विद्वान आचार्य श्री वादीदेवसूरीश्वरजी दोनों विक्रम वर्ष 1143 में इस गांव में थे। विक्रम वर्ष 1287 में अबू-दिलवाड़ा के लावण्यवसही मंदिर के वार्षिक उत्सव को मनाने के लिए गठित समिति में इस गांव का नाम भी शामिल है। विक्रम वर्ष 1499 के कवि श्री मेघ की रचना तीर्थमाला में यहां विद्यमान श्री महावीर भगवान के मंदिर का उल्लेख है। ऐसा प्रतीत होता है कि यह मंदिर किसी समय भूकंप के झटकों के दौरान दब गया था। मौजूदा इष्टदेव श्री महावीर भगवान की बड़े आकार की मूर्ति और दो अन्य मूर्तियाँ श्री पार्श्वनाथ भगवान और श्री विमलनाथ भगवान की ध्यान मुद्रा में खड़ी मुद्रा में (श्री विमलनाथ भगवान की मूर्ति पर विक्रम वर्ष 1259 के एक शिलालेख के साथ) एक के पास भूमिगत से खोजी गई थीं। गांव के बाहर पहाड़ी. संभवतः यह श्री महावीर भगवान की वही मूर्ति है जिसका उल्लेख कवि मेघ ने अपनी तीर्थमाला में किया है। विक्रम संवत 1920 में एक बार फिर यहां मंदिर का निर्माण कर इस प्राचीन स्वर्गीय मूर्ति की समारोहपूर्वक प्राण-प्रतिष्ठा कर स्थापना की गयी।महरीद गच्छ की स्थापना इसी स्थान पर हुई थी। गाँव के बाहर बिखरे पड़े असंख्य खंडहरों से ऐसा लगता है जैसे इस बड़े शहर में असंख्य जैन मंदिर हों। ऐसा लगता है जैसे इस बड़े शहर में असंख्य जैन मंदिर हों। स्थानीय श्रेष्ठियों द्वारा समय-समय पर गांव के बाहर कई धार्मिक अवसरों में भाग लेने के संदर्भ उपलब्ध हैं।हर साल माघ शुक्ल 13 को यहां शिखर मंदिर के शिखर पर ध्वजा फहराई जाती है।खुदाई के परिणामस्वरूप भूमिगत से प्राप्त मुख्य देवता की मूर्ति के साथ-साथ श्री पार्श्वनाथ भगवान और श्री विमलनाथ भगवान की ध्यान मुद्रा में खड़ी हुई सभी मूर्तियाँ न केवल आकर्षक हैं बल्कि बहुत ही अभिव्यंजक और प्रभावशाली हैं। इस मंदिर के अलावा, यहां आसपास के क्षेत्र में श्री धर्मनाथ भगवान का एक और प्राचीन मंदिर है।दृष्टिकोण – मार्ग :आबू रोड का नजदीकी रेलवे स्टेशन 50 किलोमीटर दूर है जहाँ टैक्सियाँ और बसें उपलब्ध हैं। यहां सिरोही, डीसा और आबू रोड से सीधी बसें आती हैं। मंदिर से बस स्टैंड केवल 200 मीटर की दूरी पर है। मंदिर तक बसें और कारें जा सकती हैं।जैन तीर्थयात्रियों के लिए सुविधाएं:ठहरने के लिए केवल एक उपाश्रय है जहां पानी और बिजली उपलब्ध है। एक आयंबिलशाला भी उपलब्ध है।', '2023-08-20 13:44:21', '2023-08-20 13:44:21', 0, 0, NULL, NULL, 15, 27),
(369, NULL, 'पिंडवडा तीर्थ', '02971220028', NULL, 'Gadawa Colony, Pindwara, Rajasthan 307022, India\r\nPindwāra, राजस्थान, 307022', '105', '19', '928', '307022', '2023-08-20 13:51:56', '2023-08-20 13:51:56', 0, 0, NULL, NULL, 15, 27),
(370, '/utilites_banner/110889479794931_ajaari.jpg', 'अजरी तीर्थ', '02971220028', NULL, 'श्री कल्याणजी सौभागचंदजी जैन पेढ़ी\r\nपो. अजारी - 307 021\r\nजिला: सिरोही, राजस्थान\r\nटेलीफोन: 02971 - 20028 (पिंडवाड़ा) पीपी', '105', '19', '929', 'अजारी (श्वे) नामक गांव में स्थित मंदिर में सफेद रंग के श्री महावीर भगवान 75 सेमी ऊंचे कमल आसन पर विराजमान हैं।प्राचीनता और प्रमुख विशेषताएं:यह अत्यंत प्राचीन स्थान है, जिसकी प्राचीनता का पता लगाना बहुत कठिन है। कलिकाल सर्वज्ञ (चक्र के इस भाग में होने वाली सभी घटनाओं का ज्ञाता)। श्री हेमचंद्राचार्य ने जब पास के मार्कंडेश्वर में श्री सरस्वतीदेवी के मंदिर में गहन तपस्या की, तो उन्हें इस जैन मंदिर में देवी सरस्वती की व्यक्तिगत उपस्थिति के दर्शन करने का सौभाग्य मिला। मंदिर के समीप एक वाव में विक्रम वर्ष 1202 का एक शिलालेख मिला है जिसमें परमार राजा यशोधवल का वर्णन मिलता है। यहां धातु से बनी कुछ मूर्तियों पर विक्रम 11वीं और 13वीं शताब्दी के शिलालेख मिले हैं। इष्टदेव की मूर्ति पर कोई शिलालेख नहीं मिलता है। मूर्ति के कला मॉडल से ऐसा प्रतीत होता है कि मूर्ति अति प्राचीन है। आसपास के 52 छोटे एक कमरे वाले मंदिरों वाले इस भव्य मंदिर में, ऐसा प्रतीत होता है कि सभी मूर्तियाँ राजा संप्रति के काल की हैं। मंदिर में आचार्यों की कुछ सुंदर छवियां भी हैं जिनमें से एक काफी उत्कृष्ट है जिस पर 12वीं विक्रम शताब्दी का एक शिलालेख पाया गया है।श्री हेमचंद्राचार्य ने देवी श्री सरस्वतीदेवी की व्यक्तिगत उपस्थिति के दर्शन का लाभ प्राप्त करने के बाद इस मंदिर में उनकी मूर्ति स्थापित की थी। यह मूर्ति आज भी मंदिर में देखी जा सकती है। इस मूर्ति पर एक शिलालेख है जिसमें कहा गया है कि इसका अभिषेक समारोह विक्रम वर्ष 1269 को श्री शांतिसूरिजी द्वारा आयोजित किया गया था। यह संभव है कि मूर्ति की स्थापना श्री हेमचंद्राचार्य ने की थी और औपचारिक रूप से शांतिसूरिजी द्वारा प्रतिष्ठित की गई थी। श्रीसरस्वतीदेवी द्वारा किये गये चमत्कार सर्वविदित हैं। आज भी जैन और गैर जैन दोनों तरह के कई श्रद्धालु ज्ञान प्राप्त करने के लिए पूरी विनम्रता से यहां आते हैं और उनकी इच्छाएं पूरी होती हैं। यह तीर्थ छोटी मारवाड़ की पंच तीर्थियों में से एक है। एबी पर्वत के योगिराज श्री शांतिसूरिजी ने भी पास के जंगल में और श्री मार्कंडेश्वर के मंदिर में गहन तपस्या की थी और कहा जाता है कि देवी सरस्वती ने उन्हें भी दर्शन दिए थे। मार्कंडेश्वरी में जिस स्थान पर श्री विजय शांतिसूरीश्वरजी ने निवास किया था, उसे आज भी वैसे ही देखा जा सकता है जैसे पहले हुआ करता था। यह स्थान महाकवि कालिदास की भी जन्मस्थली है।इस मंदिर के साथ-साथ मार्कनेश्वर के मंदिर में भी श्री सरस्वतीदेवी की प्राचीन मूर्तियाँ बहुत प्रभावशाली हैं। ऐसी मूर्तियाँ अन्यत्र दिखना लगभग असंभव है। इसके अलावा यहां कोई दूसरा मंदिर नहीं है। इस स्थान से 1 किमी दूर मार्कंडेश्वर में श्री सरस्वतीदेवी का मंदिर है।दृष्टिकोण – मार्ग :सिरोही रोड का नजदीकी रेलवे स्टेशन 5 किमी दूर है जहाँ से ऑटो, टैक्सी और छोटी निजी बसें उपलब्ध हैं। बामनवाडजी से यह तीर्थस्थल 12 किलोमीटर दूर है और नांदिया से यह सिरोही रोड और माउंट आबू के बीच सड़क पर 10 किलोमीटर दूर है। मंदिर तक तारकोल की सड़क है।जैन तीर्थयात्रियों के लिए सुविधाएं:मंदिर के पास एक धर्मशाला है लेकिन वर्तमान में सुविधाएं उपलब्ध नहीं हैं। इसलिए बामनवाडजी या पिंडवाड़ा में रुककर यहां आने की सलाह दी जाती है।', '2023-08-20 14:00:24', '2023-08-20 14:00:24', 0, 0, NULL, NULL, 15, 27);
