(371, '/utilites_banner/403781646mirpur-jain-temp-01.jpg', 'मीरपुर जैन मंदिर, मीरपुर', NULL, NULL, 'एसएच 27, मीरपुर तीर्थ रोड, वेधायनाथ कॉलोनी, सिरोही, राजस्थान 307001', '105', '19', '930', 'मीरपुर जैन मंदिर, संप्रति राजा द्वारा निर्मित 23वें जैन तीर्थंकर, भगवान श्री पार्श्वनाथ को समर्पित प्रसिद्ध मंदिरों में से एक है।\r\n\r\nमीरपुर जैन मंदिर राजस्थान के सबसे पुराने संगमरमर के मंदिरों में से एक माना जाता है, माना जाता है कि इसका निर्माण 9वीं शताब्दी ईस्वी में राजपूत शासन के दौरान हुआ था। इस मंदिर की प्राचीन कला बाद के दिलवाड़ा और रणकपुर मंदिरों के लिए एक मॉडल के रूप में काम करती थी। अपने मंडप के साथ मुख्य मंदिर नक्काशीदार स्तंभों और भारतीय पौराणिक कथाओं के हर पहलू का प्रतिनिधित्व करने वाली उत्कीर्ण परिक्रमा के साथ ऊंचे स्थान पर खड़ा है।\r\n\r\n200 साल पहले मीरपुर जैन मंदिर से कई मूर्तियां वितरित की गईं और श्री गोड़ीजी पार्श्वनाथजी की मूर्ति में से एक मूर्ति विश्व प्रसिद्ध श्री गोड़ीजी पार्श्वनाथ पायधुनी जैन मंदिर, मुंबई के लिए सेठ श्री मोतीशाहजी को दी गई थी।वर्ष 1904 में, सेठ कल्याणजी परमानंदजी पेढ़ी सिरोही ने नांदिया शासकों से मंदिर के आसपास की जमीन खरीदी और तब से पेढ़ी पूरे मीरपुर जैन मंदिर का प्रबंधन कर रहे हैं। मंदिर में 1162 ईस्वी के शिलालेख हैं, जिनमें 12वीं से 15वीं शताब्दी के अन्य 7 शिलालेखों के साथ-साथ इतिहास का भी उल्लेख है। 13वीं शताब्दी में गुजरात के शासक सुल्तान महमूद बेगड़ा ने इस मंदिर को नष्ट कर दिया था, लेकिन 15वीं शताब्दी में इसका पुनर्निर्माण और जीर्णोद्धार किया गया। यह मीरपुर गांव से दो किलोमीटर की दूरी पर जंगल में पहाड़ियों के बीच है। इसके अलावा, भगवान महावीर का एक मंदिर और दो अन्य मंदिर वर्तमान में यहां हैं।सिरोही का नया पावापुरी जैन तीर्थ मीरपुर जैन तीर्थ से 10 किमी की दूरी पर स्थित है।', '2023-08-20 14:07:09', '2023-08-20 14:07:09', 0, 0, NULL, NULL, 15, 27),
(372, NULL, 'दियना तीर्थ', '02971-242574', NULL, 'Shri Diyanji Jiwit Swamiji Pedhi\r\nP.O. Diyana – 307 023\r\nDist : Sirohi , Rajasthan\r\nTel : 02971 – 57436\r\nMain Office (Sarupganj)\r\nTel : 02971 – 42574', '105', '19', '720', 'Shri Mahavir Bhagwan in white color, seated in a lotus posture of height 90 Cms in a shrine amidst a forest and in the middle of hills.ANTIQUITY AND SALIENT FEATURES :This shrine is believed to be of the period comtemporaneous to Sri Mahavir Bhagwan .The idol also is as old . It is stated that when Sri Mahavir Bhagwan came here, he meditated in a standing posture and his brother Nandivardhan after building a temple with 52 surroundings small single room shrines got this idol installed and ceremonially consecrated. The art of the idol itself is a testimony of its antiquity.Renovations must have been carried out here countless times. At one time, this must have been a very vast city. Today only this temple in the middle of these beautiful hills in a dense and wild forest reminds one of its antiquity. A reference is available therein that “Parshvanath Chaitra” was composed here on Thursday, Paush Sukla 6 in Vikram year 1436.This shrine is one of the Panch Tirth of Chotti Marwad. A temple in this style, so ancient and located in a quiet solitude of a forest and brimming with spiritual vibration is rarely to be found anywhere else. There is no other temple in the immediate vicinity.With hills on three sides, the quiet atmosphere of the forest during evenings and nights makes one devout and cheerful. One instantly feels one is transposed into heaven. Sounds of roaming wild animals around remind one of their prayers also to the divine. The equipoised idol though so ancient make one feel that the Lord himself is seating there alive! This shrine is also called “Jiwitswami”.APPROACH – ROUTE :\r\nThe nearby railway station of Sarupganj is 18 kms away from where one can come here via Nothoda. Car and bus can go upto the temple.AMENITIES FOR JAIN PILGRIMS :There is a dharamshala in the courtyard of the temple where cooking pots, water, mattresses and bhojanshala for meals are availabLE', '2023-08-20 14:11:47', '2023-08-20 14:11:47', 0, 0, NULL, NULL, 15, 27),
(373, '/utilites_banner/96598511222003_jhadoli.jpg', 'श्री झाड़ोली तीर्थ', '02971220170', NULL, 'श्री आदिश्वर जैन श्वेताम्बर पेढ़ी\r\nपो. झाड़ोली - 307 022\r\nजिला: सिरोही, राजस्थान\r\nदूरभाष: 02971 - 220170', '105', '19', '931', 'सफेद रंग में श्री आदिनाथ भगवान, झाड़ोली (श्वे) गांव में स्थित मंदिर में 60 सेमी ऊंचे कमल आसन पर विराजमान हैं।प्राचीनता और प्रमुख विशेषताएं:शिलालेखों से यह माना जाता है कि यह स्थान सुदूर अतीत में ज़डवली, ज़वावली, ज़ज़ुली आदि नामों से जाना जाता था, मंदिर में विक्रम वर्ष 1234 और 1236 के शिलालेख पाए गए हैं। एक संदर्भ उपलब्ध है कि विक्रम वर्ष 1252 के शासनकाल के दौरान श्री चंद्रावती नगर के राजा श्री धारावर्ष (इस समय उनके मंत्री श्री नागद थे जो कला में कुशल थे) के शासनकाल में, मंदिर के मंडप का जीर्णोद्धार किया गया और छह और \"चौकियों\" का निर्माण किया गया। मंदिर के एक शिलालेख में कहा गया है कि दयालु धारावर्ष की प्रमुख रानी श्री श्रृंगारदेवी (नाडोल के राजा कल्हणदेव चौहान की बेटी) ने विक्रम वर्ष 1255 में एक धर्मनिष्ठ परोपकारी व्यक्ति की उपस्थिति में इस मंदिर को एक कुआँ उपहार में दिया था। श्री नीरद नाम दिया गया। शिलालेख का मसौदा आचार्य श्री तिलकप्रभसूरिही द्वारा तैयार किया गया था। यह कुआँ अभी भी जैन समुदाय के नियंत्रण और अधिकार में है। लोग इसे \"देव-नी-वाव\" (भगवान का कुआँ) कहते हैं। इस कुएं में एक शिलालेख भी मिला है।उपरोक्त इस बात पर जोर देने का प्रमाण है कि यह मंदिर विक्रम वर्ष 1252 से पहले का है। उस समय इष्टदेव श्री महावीर भगवान थे। इसके बाद कुछ जीर्णोद्धार के दौरान, श्री आदिनाथ भगवान की मूर्ति को समारोहपूर्वक स्थापित किया गया होगा। इस मूर्ति को श्री शांतिनाथ भगवान भी कहा जाता है। विक्रम वर्ष 1499 में श्री मेघ कवि ने अपनी रचना \"तीर्थमाला\" में इस मंदिर को श्री शांतिनाथ भगवान का मंदिर कहा है। मूर्ति पर विक्रम वर्ष 1632 का एक शिलालेख पाया जाता है। एक समय यह स्थान एक समृद्ध शहर था, जैसा कि उपलब्ध पत्थर के शिलालेखों से स्पष्ट है। समय-समय पर विभिन्न राजाओं द्वारा इस तीर्थ के प्रति दिखाई गई आस्था एवं भक्ति उल्लेखनीय है।हर साल मगसर शुक्ल 6 को शिखर मंदिर के मस्तूल पर एक झंडा फहराया जाता है। आसपास ही एक और मंदिर है।\r\nमंदिर के मेहराब स्तंभों पर प्राचीन कला अबू-दिलवाड़ा के मंदिरों की याद दिलाती है।दृष्टिकोण – मार्ग :सिरोही का नजदीकी रेलवे स्टेशन 3 किलोमीटर दूर है जहाँ से टैक्सियाँ और ऑटो उपलब्ध हैं। सार्वजनिक बस स्टैंड मंदिर से एक किलोमीटर दूर है। कार और बसें मंदिर तक जा सकती हैं। यह तीर्थ बामनवाडजी के तीर्थ से 4 कि.मी. दूर है।जैन तीर्थयात्रियों के लिए सुविधाएं:यहां रहने के लिए भोजनशाला सहित सभी सुविधाओं से युक्त धर्मशाला है।', '2023-08-20 14:17:29', '2023-08-20 14:17:29', 0, 0, NULL, NULL, 15, 27),
(374, NULL, 'Shri Sirohi Jain Tirth, Chomukha Jinalaya, Bagikhana, Sirohi', '02972230631', NULL, 'Shri Sirohi Jain Tirth, Chomukha Jinalaya, Bagikhana, Sirohi (Rajasthan)', '105', '19', '461', 'राजस्थान में सिरोही को अर्ध शत्रुंजय की उपमा दी गयी है, क्योंकि वहाँ एक ही नींव पर अति प्राचीन १४ मंदिर निर्मित है, जिसमें ३ बावन जिनालय है। जैन समाज की यह अनमोल धरोहर है, सभी मूर्तियां मनोहर और मनलुभावनी हैं, इनके दर्शन मात्र से हमारा मन मयूर नाच उठता है। मंदिरजी में नक्काशी इतनी बारीक और कलात्मक है कि कई बार तो ऐसा आभास होता है कि पथ्थर पर कोरनी नहीं होकर कोई जीवित कलाकृति ही है। आबू देलवाड़ा की कलाकृति का प्रतिबिंब अगर देखना हो तो इस नगरी के इन १४ जिन मंदिरों में दृष्टिगोचर होगी। नगर में और भी १० मंदिर है। सिरोही में सुनारवाड़ा क्षेत्र में धर्मशाला, भोजनशाला और आयंबिल खाता जी समुचित व्यवस्था है।श्री ऋषभदेव भगवान चौमुखा जी 72 जिनालय तीन मंजिला जैन मंदिर , सिरोही एक श्रेष्ठी व्यापार के लिए इस क्षेत्र से गुजर रहा था उस समय इस क्षेत्र को असाधारण शुद्ध और उसके शांतिपूर्ण रुप को देख प्रसन्न हुआ फिर उन्होंने विक्रम वर्ष 1323 के शुभ दिन अर्थात आसोज सुक्ला 5 में श्री आदिनाथ भगवान के मंदिर का निर्माण कार्य शुरू किया। एक संदर्भ मिलता है, जिसमें कहा गया है कि इस मंदिर के पूर्ण होने पर विक्रम वर्ष 1339 में आषाढ़ शुक्ल 13 को प्रतिष्ठा हुयी । इस मंदिर को आचंलगच्छ के मंदिर के रूप में जाना जाता है। विक्रम वर्ष 1499 में पन्यास श्री मेघगणी विजयजी की एक रचना \"तीर्थमाला\" में, यह मंदिर पूरी तरह से वर्णित है। विक्रम वर्ष 1424 कार्तिक पूर्णिमा के दिन 52 जिनालय जिसमे मूलनायक श्री आदिनाथ भगवान है जिसकी प्रतिष्ठा हुयी थी ।श्री ऋषभदेव भगवान चौमुखा जी 72 जिनालय तीन मंजिला जैन मंदिर सिरणवा पहाड़ी की तलहटी में सिरोही पैलेस के निकट शांत वातावरण मे बना हुआ है । कहते है यह मंदिर रणकपुर जैन मंदिर की तर्ज पर बनाया है । सिरोही के इस मंदिर में 400 खंबे है और हरेक खंबे से मानो नवकार मंत्र की धुन सुनाई दे रही है ।इस मंदिर का ढांचा खंभे पर खड़े राणकपुर के समान है। यह सिरेनवा पहाड़ियों की पश्चिमी ढलान पर स्थित है और 78 फीट ऊंचे शिखर (शिखर) द्वारा दर्शाया गया है।इस मंदिर को सिरोही से बहुत दूर से देखा जा सकता है।लगभग 500 साल पुराने इस जैन मंदिर की महिमा निराली है । इस चौमुखा जैन मंदिर में चारों दिशाओं से भगवान के दर्शन होते हैं , इस मंदिर को जब पहली , दूसरी और तीसरी मंजिल के साथ सिरोही को उंचाई से देखा ता आनंद आ गय ।मुगल बादशाह अकबर को अहिंसा परमोधर्मः की बात कहने वाले संत जगद्गुरु श्री हीर विजय सूरीश्वर जी महाराज सा ने इस मंदिर मे साधना की थी और यही उनको श्री आचार्य जी की उपाधि मिली । मंदिर के नीचे बनी गुफा मे मां सरस्वती जी का मंदिर है कहते हैं जगद्गुरु आचार्य श्री हीर विजय सूरीश्वर जी महाराज सा यही बैठकर साधना करते थे ।\r\nपरम पू आचार्य श्री रामसूरीजी (डेहलावाला समुदाय ) ने इस मंदिर की वि.सं. २०१०मां वैशाख सुद-५ आदिनाथ चतुर्मुख जिनमंदिर बावन जिनालयनी सिरोही (राजस्थान) की प्रतिष्ठा करावी वरिष्ठ समाजसेवी श्री अमृत लाल जी सिंघी साहब ने बताया कि श्री ऋषभदेव भगवान चौमुखा 72 जिनालय तीन मंजिला जैन मंदिर भारत मे तीसरा बडा़ मंदिर है । श्री देलवाड़ा जैन मंदिर और श्री रणकपुर जैनमंदिर के बाद इस मंदिर का नाम है ।', '2023-08-20 14:22:06', '2023-08-20 14:22:06', 0, 0, NULL, NULL, 15, 27),
