(376, NULL, 'Shree Rata Mahavir Shwetamber Jain Tirth', '02933240139', '9982463460', 'Shree Hatundi Rata Mahavir Tirth\r\nHatundi, PO : Bijapur, Jilla: Pali, Rajasthan 342312\r\nphone : 02933 240 139 \r\nMobile : 9982463460', '105', '19', '932', '342312', '2023-08-20 14:34:34', '2023-08-20 14:34:34', 0, 0, NULL, NULL, 15, 27),
(377, '/utilites_banner/1483003869Worshippers_leaving_the_temple_in_Ranakpur.jpg', 'राणकपुर तीर्थ', '02934285021', '02934285019', 'RANAKPUR', '105', '19', '933', 'यह परिसर लगभग ४०,००० वर्ग फीट में फैला है। करीब ६०० वर्ष पूर्व १४४६ विक्रम संवत में इस मंदिर का निर्माण कार्य प्रारम्भ हुआ था जो ५० वर्षों से अधिक समय तक चला। इसके निर्माण में करीब ९९ लाख रुपए का खर्च आया था। मंदिर में चार कलात्मक प्रवेश द्वार हैं। मंदिर के मुख्य गृह में तीर्थंकर आदिनाथ की संगमरमर से बनी चार विशाल मूर्तियाँ हैं। करीब ७२ इंच ऊँची ये मूतियाँ चार अलग दिशाओं की ओर उन्मुख हैं। इसी कारण इसे चतुर्मुख मंदिर कहा जाता है। इसके अलावा मंदिर में ७६ छोटे गुम्बदनुमा पवित्र स्थान, चार बड़े प्रार्थना कक्ष तथा चार बड़े पूजन स्थल हैं। ये मनुष्य को जीवन-मृत्यु की 84 लाख जीवयोनियों से मुक्ति प्राप्त कर मोक्ष प्राप्त करने के लिए प्रेरित करते हैं।\r\n\r\nमंदिर के सैकड़ों खम्बे इसकी प्रमुख विशेषता हैं। इनकी संख्या करीब १४४४ है। जिस तरफ भी दृष्टि जाती है छोटे-बड़े आकारों के खम्भे दिखाई देते हैं, परंतु ये खम्भे इस प्रकार बनाए गए हैं कि कहीं से भी देखने पर मुख्य पवित्र स्थल के \'दर्शन\' में बाधा नहीं पहुँचती है। इन खम्भों पर सुंदर नक्काशी की गई है।\r\n\r\n\r\nमंदिर की छतपर की गई उत्कृष्ट नक्काशी\r\nमंदिर के निर्माताओं ने जहाँ कलात्मक दो मंजिला भवन का निर्माण किया है, वहीं भविष्य में किसी संकट का अनुमान लगाते हुए कई तहखाने भी बनाए हैं। इन तहखानों में पवित्र मूर्तियों को सुरक्षित रखा जा सकता है। ये तहखाने मंदिर के निर्माताओं की निर्माण संबंधी दूरदर्शिता का परिचय देते हैं। मंदिर के उत्तर में रायन पेड़ स्थित है। इसके अलावा संगमरमर के टुकड़े पर भगवान ऋषभदेव के पदचिह्न भी हैं। ये भगवान ऋषभदेव तथा शत्रुंजय की शिक्षाओं की याद दिलाते हैं।', '2023-08-20 14:39:42', '2023-08-20 14:39:42', 0, 0, NULL, NULL, 15, 27),
(378, NULL, 'सादडी तीर्थ', '02934285017', NULL, 'SADARI', '105', '19', '718', 'SDARI', '2023-08-20 14:41:52', '2023-08-20 14:41:52', 0, 0, NULL, NULL, 15, 27),
(379, NULL, 'Shri Nadlai Teerth', '02934282424', NULL, 'Shri Shwetambar Jain Devsthan Pedhi; At & Post: Nadlai; Via: Desuri; Dist.: Pali; State: Rajasthan. INDIA. Telephone: (02934) 82424.', '105', '19', '934', 'Shri Neminath Bhagwan is Padmasanastha & Blueish (Shyam) in colour, while idol of Shri Adinath Bhagwan is whitish (Swet) in clour. Both the idols are identical in height being 75 cms.Jain God Desc:	\r\nAncient teerthJain Teerth:On peak of two different opposite hills outside Nadlai village. It is said that the son of Shri Krishna, Pradumna Kumar has established thes temples. The hill having temple of moolnayak Shri Neminath is called as Yadavtekari while that of Shri Adinath Bhagwan as hatrunjaytekari. People says that these are the models of Shatrunjay & Girnar teerth. It takes around an hour for climbing the hill.Speciality of Jain Teerth:Founded by Shri Naradji, this city has much importance, as the teerth is said to be established by Pradyumna Kumar, the son of Shri Krishna. As per a famous myth, (also described in Teerth Mala written by Lavanyasamay) shashtratha was held among great Jain scholar Acharya Shri Yashobhadra Surishwarji and Great Yogi Tapesarji in the king\'s court. During the ompetition,Yashobhadra Surishwarji has created a temple of Shri Adinath Bhagwan by his miraculous power of sadhana while Tapesarji has brought an Shaiv temple through space. At last Tapesarji losed to Acharyashri. He then accepted deeksha from Acharya Shri Yashobhadra Surishwarji and later on became popular as Kesav Suriji (Vasudevacharya). Both the temples are still present in Narlai and are called as Jasia & Kesia temples. Shri Keshav Suriji preached king of Hathundi Shri Vidagdharaj & converted him into Jainism. The portraits of Shri Yashobhadra Surishwarji & SHri Keshav Suriji have been established in their memory as they have attained swarga at this holy place. Shri Vijaysen Suriji, the Shishya of Akbar pratibodhak Acharya Shri Heervijay Suriji, was born here and the post of Panyas & Upanyas was awarded to him at this holy teerthplace.Managing Trust:	Shri Shwetambar Jain Devsthan Pedhi', '2023-08-20 14:47:33', '2023-08-20 14:47:33', 0, 0, NULL, NULL, 15, 27),
(380, '/utilites_banner/507780086images.jpeg', 'MUCHHALA MAHAVIR JAIN TEMPLE', '029342824056', NULL, 'Lord Mahavir, at Ghanerao, in Pali district in Rajasthan', '105', '19', '829', 'According to Jain legends, Rana Raj Singh I of Mewar once visited this temple to offer prayer. He noticed a white hair while putting saffron to the idol. Upon question about the hair, the temple priest replied that the hair was from the moustaches of Lord Mahavira. Following, this Rana insisted to see moustache. The temple priest fasted for three days and pleased with this the protecting deity showed moustache on the face of the idol. When Rana uprooted the moustache, blood oozed out of the spot. Following this Rana became a staunch devoutee of the Mahavira and the idol was named Mucchal Mahavir, or the Mahavir who had a moustache.[1]', '2023-08-20 14:52:22', '2023-08-20 14:52:22', 0, 0, NULL, NULL, 15, 27),
(381, '/utilites_banner/145233967680_thumbnail.jpg', 'SHRI VARKANA TIRTH', '742692363', '02934222257', 'Sri Parshvanath Jain Devasthan Pedhi\r\nP.O. Varkana – 306 601.\r\nDist :Pali, Rajasthan\r\nTel : 02934 – 22257.', '105', '19', '935', 'Sri Parshvanath Bhagwan in white color, seated in lotus posture, of height 30 Cms located in a shrine in the middle of a village Varkana (Shve). ANTIQUITY AND SALIENT FEATURES :In ancient times, this place has been called Varkanakpur or Varkanaknagar. A reference has been found suggesting that in past ages, this was a large and prosperous city. During the period of Rana Kumbha, affluent Jain house-holders of Srimalpur had carried out renovations to this shrine. There is no inscription available on the idol. On a pillar of nine sides there is one inscription dated Vikram year 1211, outside the gate there is a stone inscription dated Vikram year 1686. A reference is found that the pilgrim tax of this place was cancelled by Rana Sri Jagatsinh of Mewad at the instance of Acharya Vijaydevsuri. The idol here , it is believed has been installed and ceremonially consecrated in Vikram year 515.This shrine is one of the Godwal Panch Tirthi. In the composition entitled “Stotra”, this shrine has been referred to. The work and activities of the boarding school for students established here at the inspiration of Acharya Sri Vikaylalitsuriji, the disciple of Acharya Sri Vijayvallabhsurij are praise worthy. Every year on Posh Krishna 10 a big fair is held here. There are no other temples nearby. The art on sikhars as well as in making the idol of the lord is indeed noteworthy.', '2023-08-21 14:15:55', '2023-08-21 14:15:55', 0, 0, NULL, NULL, 15, 27),
(382, '/utilites_banner/60067937087197_nadol.jpg', 'SHRI NADOL TIRTH', NULL, '02934240044', 'Sri Jain Shvetamber Devasthan Pedhi\r\nP.O. Nadol – 306 603,\r\nDist :Pali, Rajasthan\r\nTel : 02934 – 40044.', '105', '19', '820', 'Sri Padmaprabhu Bhagwan in white color, seated ina lotus posture, height 130 Cms located in a shrine in the middle of a village by the name of Nadol. (Shve) ANTIQUITY AND SALIENT FEATURES :In scriptures, this village has also been called by the names of Nandpur, Naddul, Nardulpur etc., This shrine is believed to be very ancient, of the period before king Samprati. Here before Vikram year 300, Sri Acharya Mandevsuriji, disciple of Sri Devsuriji in one of his chautarmas, had composed his Stotra (laudatory hymn ) of “Laghushanthi” There is a reference which states that in Vikram year 700, the idol of Sri Neminath Bhagwan was installed can consecrated by Sri Ravi Prabhusuriji. From a deed of gift dated Vikram year 1228, it is found that Raja Alandev of Chouhan dynasty had built here a temple of Sri Mahavir Bhagwan. From stone-inscriptions it is also found that Sri Shalibhadrasuriji in Vikram year 1181, Sri Devsuriji’s disciple Sri Padmachadraganiji in Vikram year 1215, Sri Sumarisuriji in Vikram year 1237 and Sri Vijaydevsuriji in Vikram year 1686 had ceremonially sanctified some temples here. In “Tirthmala” composed by Sri Gnanvimalsuriji in Vikram year 1755, this shrine has been referred to. There is an inscription dated Vikramyear 1686 on the idol of the presiding deity. On several other idols, the inscriptions dated Vikram Year 1215 are seen. For centuries this place wallowed in prosperity and some one time it must have been a very large city as in found in references.Here in the temple of Sri Neminath Bhagwan there is an underground ancient vault which is believed to go upto Nadalayi. Before Vikram year 300Acharya Sri Mandevsurivarji by practicing intense yoga in this vault had composed the “Stotra” (hymn) of “Laghu Shanthi” with the object of eradicating a great contagious disease ( called Mahamari) causing death to people. This hymn of “Laghu Shanthi” is still being sung for bringing peace and happiness at many places. On the entrance gate of this vault, an idol of Acharya Sri is installed where for the last 1775 years an eternal lamp is kept burning continuously. The most proficient debator Sri Shanthisuriji had taught here all scriptures of logistics to Munichandrasuriji. It was also here that in Vikram year 1049 Sri Dadarao, son of the local king named Sri Lakhanshi had got himself initiated into the Jain order of saints by that erudite scholar Acharya Sri Yashobhadrasuriji. During 11th Vikram century, the king of this city had presented a throne of gold to the minister Sri Vimalshah. The Bhandari and Kothari “Gotra” ( a clan) Is believed to have been founded in this city of Nadol. There are three other temples of which the one of Sri Neminath Bhagwan is believed to be very ancient. The vault in which Sri Mandevsuriji composed is hymn of “Laghu Shanthi” is located in this temple. In the temples here, are ancient artistic idols. One idol of Sun-God and one small temple with quadruple fronts made of gold touch-stone without joints are extremely fascinating. From the ruins of the ancient temple of Sri Mahavir Bhagwan, three large size idols were recently recovered, whose installationand consecration ceremonies took place in Vikram year 2014. These are worth seeing. Near the present village there appear scattered many structures including small stepped-wells where if proper researches are carried out one is sure to find ancient material of great historical significance.', '2023-08-21 14:20:05', '2023-08-21 14:20:05', 0, 0, NULL, NULL, 15, 27),
(383, '/utilites_banner/37218258888143_sanderao.jpg', 'SHRI SANDERAO TIRTH', NULL, '02938244156', 'Sri Shanthinath Jain Mandir Trust Pedhi\r\nP.O. Sanderao – 306 708\r\nDist : Pali, Rajasthan\r\nTel : 02938 – 44156 / 44124 (P.P).', '105', '19', '713', 'Sri Shanthinath Bhagwan in white color, seated in a lotus posture, of height 75 Cms located in a shrine in the village Sanderao. (Shve).ANTIQUITY AND SALIENT FEATURES :This shrine is believed to be 2500 years old. A reference is found that during the rule of Raja Gandharvsen, the idol of Sri Parshvanath Bhagwan was installed and ceremonially consecrated in this temple as the Presiding Deity. On one “Parikar” in the temple there is an inscription which states that in Vikram year 969 at the time of renovations, the idol of Sri Mahavir Bhagwan was installed and ceremonially consecrated as the Presiding Deity. There after in16th Vikram century at the time of renovations once again, a reference is available which states that the idol of Sri Shanthinath Bhagwan brought here from some where else was installed and consecrated. This idol is still present as the Presiding Deity and the idol has no inscription thereon. Ancient idols of both previous Presiding Deity are today present in the temple. Below the idol on one Acharya in this temple there is an inscription dated Vikram year 1197. There are ancient underground cells also in the temple. After the fall and destruction of Vallabhi, it is said that, many things were brought here. In ancient times, a store house of scriptures is believed to be existing here. History of this place being very ancient, it is possible that if proper excavations are carried out, many valuable articles of historical significance including relics of art will be found here.Sanderak Gachchha was founded here during 10th Vikram century. It is said that in Vikram year 969, at the time of ceremonial installation festival after repairs and renovations of the temple, Acharya Sri Yashobhadrasurishvarji by his Yogic powers had commandeered necessary quantity of ghee from a trader at Pali about which the trader himself did not know and later on when people from Sanderao sent the amount being the price of the ghee to the trader of Pali, the latter did not accept the amount as not belonging to him. Finally the whole amount which came to be nine lakhs of rupees was spent in building a temple at Pali which temple still stands today as “Navlakha Temple”. The idol of the Presiding Deity in this temple is a great worker of miracles. Some times the Guardian Deity of Sri Parshvanath Bhagwan Sri Dharmendra appears in the temple in the form of a cobra. Opposite the temple is an Upashraya, there is the seat of Manibhadra Yaksh where also many miracles happen from time to time. Every year on Vaishakh Sukla 6, the dhvaja ceremony of the temple takes place.The architecture of this temple is unique. The temple is 6 feet below the ground level. During rains a great amount of water gets collected in the temple. In the temple chowk (a built up area within the temple) there is a hole from which all this water gets drained away. How this happens and where does the water ultimately go, nobody has been able to know till date. The idol itself is very pleasant and beautiful to see.There are two other temples, one Guru Mandir and other Manibhadra temple besides this temple here.', '2023-08-21 14:24:22', '2023-08-21 14:24:22', 0, 0, NULL, NULL, 15, 27),
(385, '/utilites_banner/1111961493Jalore-Teerth3.jpg', 'SHRI JAORE JAIN TIRTH JALORE', '02973232386', '02973233886', 'Shri Mahavir Swami AddressNear Bus Stand, Jalore 343001, Rajasthan', '105', '19', '741', 'The Temple is situated on a small hillock called ‘swarnagiri’. At the base of the slope of this hill, there are 12 Jain temples. Among these, are ancient Ashtapad Temple, Parshwanath Temple & Chaumukhi temple. On Swarnagiri , a 2 KM long & 1 KM broad fort has four ancient temples. From the fort, the sight of the temples built on the slope looks spectacular. In the Jalore town, a newly built Nandishwar Temple also has become very popular. Brief HistoryVicharshreni’ composed by erutungsuri ji & ‘Ashtottari Teerhmala’ composed by Mhendrasuriji has the mention of Swarnagiri, also known as ‘Kanakayal’. It is also found in the ‘Sakalarth stotr.’', '2023-08-21 14:32:59', '2023-08-21 14:32:59', 0, 0, NULL, NULL, 15, 27),
(386, '/utilites_banner/1738535819jahaj-mandir-mandavla-mandwala-jalore-jain-temples-byuz0ydx3p.avif', 'MANDAWALA JAHAJ MANDIR TIRATH', '96496 40451', '02973256284', 'Jahaj Mandir, Mandawala, Bishangarh, Rajasthan 343042', '105', '19', '687', 'Jahaj Mandir is a Jain temple in the village of Mandwala in the Jalore district, Rajasthan, India. The temple is built in the shape of a boat and is carved from marble. The temple was founded in 1993 for the religion of Jainism. On 9 May 1993, the foundation stone of the temple was laid at Mandawala.', '2023-08-21 14:38:10', '2023-08-21 14:38:10', 0, 0, NULL, NULL, 15, 27),
(387, '/utilites_banner/15089067313674_Sri-Aahor-Tirth1.jpg', 'श्री अहोरे तीर्थ', '02978222411', '02978220409', 'श्री शांतिनाथ भगवान जैन श्वेतांबर मंदिर,\r\nडाकघर आहोर - 307 029  जिला: जालोर, राजस्थान\r\nश्री गौड़ी पार्श्वनाथ भगवान जैन श्वेतांबर मंदिर पेढ़ी\r\nपी.ओ. आहोर - 307 029 दूरभाष : 02978 - 22409 (मंदिर) 02978 - 22411 (पेढ़ी)।\r\n\r\nफेसबुकट्विटरWhatsAppजीमेल लगींशेयर करना\r\n\r\n\r\nRead more: https://jainsite.com/jain-tirth/ahore-tirth/#ixzz8B26R194n', '105', '19', '651', 'कमल मुद्रा में विराजमान श्री शांतिनाथ भगवान आहोर शहर के मुख्य बाज़ार, जो सुखड़ी नदी के तट पर है, के मंदिर में स्थित है।प्राचीनता और प्रमुख विशेषताएं:ऐसा माना जाता है कि इस जगह का इतिहास 700 साल पहले शुरू हुआ था। विक्रम संवत 1365-68 में जालौर के शासक सोनगरा चौहान कान्हड़देव और अलाउद्दीन के बीच हुए भीषण युद्ध में यहां के सैनिकों ने बड़ी वीरता दिखाई और युद्ध जीत लिया। इससे पता चलता है कि विक्रम संवत 1365 से पहले भी यह स्थान अस्तित्वहीन था और आबाद भी था। विक्रम वर्ष 2006 में, श्री पार्श्वनाथ भगवान की मूर्ति को आचार्य श्री विजयनेंद्रसूरीश्वरजी के हाथों औपचारिक रूप से स्थापित और प्रतिष्ठित किया गया था, जो मूर्ति वर्तमान में मंदिर की पीठासीन देवता है।\r\nआहोर शहर मारवाड़ के सबसे समृद्ध और सबसे शानदार शहरों में से एक माना जाता था। इसे पूरे मारवाड़ के राज्यों में सबसे शक्तिशाली राजधानी भी माना जाता था। इस स्थान के विकास एवं उत्थान में जैन गृहस्थ परिवारों का भरपूर सहयोग रहा। यहां के समृद्ध जैन परिवारों ने निश्चित रूप से कुछ मंदिरों का निर्माण कराया होगा। श्री शांतिनाथ भगवान का मंदिर वर्तमान में यहां मौजूद मंदिरों में सबसे प्राचीन माना जाता है। ऐसा माना जाता है कि मंदिर का निर्माण विक्रम वर्ष 1444 में किया गया था, लेकिन शायद, उस दौरान एक मंदिर का जीर्णोद्धार किया गया था और फिर उसे औपचारिक रूप से पवित्र किया गया था। अंतिम नवीनीकरण विक्रम वर्ष 1997 में किया गया था। यहां श्री शांतिनाथ भगवान के प्राचीन मंदिर से निकलने वाली शुद्ध और ऊर्जावान कंपन मंदिर में आने वाले लोगों को आशीर्वाद देती है और जगह के इतिहास और प्राचीनता की याद दिलाती है। बहुत सारे चमत्कारों के साथ स्थापित गौड़ी पार्श्वनाथ भगवान बावन (52) जिनालय मंदिर अपनी विशालता और चमत्कारी घटनाओं के लिए प्रसिद्ध है। यही इस स्थान का प्रमुख महत्व है। ऐसा कहा जाता है कि विक्रम वर्ष 1936 में माघ शुक्ल दशमी को, श्री पार्श्वप्रभु की भव्य मूर्ति के साथ गौड़ी पार्श्वनाथ मंदिर को कलिहल कल्पतरु आचार्य श्रीमद विजय राजेंद्र-सूरीश्वरजी के हाथों समारोहपूर्वक पवित्र किया गया था। ठीक एक महीने बाद चैत्र कृष्ण एकादशी की रात को स्वर्ग से आकाशवाणी हुई कि \"श्री गौड़ी पार्श्वनाथ बहुत प्रसन्न हैं\" पंच तीर्थ बावन जिनालय का निर्माण कराया जाना है। राजेंद्रसूरी अंजनशलाका प्रस्तुत करेंगे। मरुधर में होगी तीर्थ प्रतिष्ठा. उस दिन के महीने के कृष्ण पक्ष से संबंधित होने के बावजूद वह स्थान कुछ अनोखी चमक के कारण रोशन दिख रहा था। वहां सभी लोग जाग गए और आकाश से ढुडुबी (एक वाद्य) का संगीत सुना, उन्होंने चारों तरफ कुमकुम के पैरों के निशान देखे और पांच प्रकार के फूलों की वर्षा देखी। सेवकों और जिसने भी यह देखा, नगर के पास गए और सब कुछ विस्तार से बताया। समस्त समाज ने प्रार्थना में सिर झुकाकर इस दिव्य वाणी से सहमति व्यक्त की और शुभ दिन में बताए अनुसार कार्य प्रारंभ करने का निर्णय लिया। तदनुसार उन्होंने काम शुरू किया और 19 वर्षों के बाद बावन जिनालय के पूरा होने पर, 951 जिनबिंबों (मूर्तियों) का अंजनशलाखा और बावन जिनालय की प्रतिष्ठा गुरुवार, फाल्गुन शुक्ल कृष्ण पंचमी, विक्रम वर्ष 1955 को पीपी आचार्य भगवंत के हाथों से की गई। श्रीमद् विजय राजेंद्रसूरिजी।यह मंदिर अत्यंत विशाल, अद्भुत एवं चमत्कारी है। ऐसा कहा जाता है कि श्री गौड़ी पार्श्वप्रभु की मूर्ति उन तीन मूर्तियों में से एक है जिन्हें राजा कुमारपाल के समय में श्री हेमचंद्राचार्य द्वारा समारोहपूर्वक प्रतिष्ठित किया गया था, जो बहुत प्रभावी, आकर्षक और चमत्कारी साबित हुई। यह भी कहा जाता है कि प्राचीन काल में यह मूर्ति चंद्रावती नगरी में थी। वर्तमान में भी यहां चमत्कारी और अविश्वसनीय घटनाएं घटती रहती हैं।हर साल श्री शांतिनाथ भगवान का ध्वजा समारोह जेठ शुक्ल 6 को और श्री गौड़ी पार्श्वनाथ भगवान का फाल्गुन ववादी 5 को होता है, जहां भव्य तरीके से मेला आयोजित किया जाता है। गौड़ी पार्श्वनाथ भगवान का मंदिर विशाल मंदिर होने के साथ-साथ कलात्मक भी है। हर जगह पर अलग-अलग तरह की कला देखने को मिलती है। इस मंदिर में तीन \"बामाती\" और एक डबल शेखर हैं और यह शायद ही कहीं और देखा जाता है। इसके अलावा गांव में 8 और मंदिर और 3 दादावाड़ी, गुरुमंदिर हैं।', '2023-08-21 14:43:01', '2023-08-21 14:43:01', 0, 0, NULL, NULL, 15, 27),
(388, '/utilites_banner/4744172842021-09-13.png', 'Parshvashanti Dham Tirth,Sanchor', NULL, '02979222028', 'Parshvashanti Dham Tirth,Sanchor\r\nmob no 070734 15161 / 081072 15101\r\nAddress - sanchor tharad highway, pratappura,sanchor (Rajasthan)', '105', '19', '681', 'श्री पार्श्वशांति धाम तीर्थ,Sanchor (Raj)\r\n१. सम्प्रति क़ालीन प्राचीन प्रतिमा के दर्शन का लाभ\r\n२. ६ लाख फूट ज़मीन पर बना विशाल तीर्थ.\r\n3. गुरु गौतमस्वामी भगवान ने जगचिंतामणि सूत्र में जिस तीर्थ को वंदना की उस पवित्र भूमि में बना हुआ तीर्थ।', '2023-08-21 14:47:35', '2023-08-21 14:47:35', 0, 0, NULL, NULL, 15, 27),
(389, '/utilites_banner/15566602852022-11-26.jpg', '72 Jinalaya Jain Tirth, Bhinmal Shri Lakshmi Vallabh Parshwanath', '02969 222 546', '02969-291172', '72 Jinalaya Jain Tirth, Bhinmal Shri Lakshmi Vallabh Parshwanath, Bhinmal.', '105', '19', '782', '72jinalyabhinmal@gmail.com', '2023-08-21 14:52:00', '2023-08-21 14:52:00', 0, 0, NULL, NULL, 15, 27),
(390, '/utilites_banner/167174876086_thumbnail.jpg', 'NAKODAJI TIRTH नाकोडाजी तीर्थ', '02988240762', '02988240005', 'Shri jain Shwetamber Nakoda Parswnath Tirth, Mewa Nagar, Balotara, Barmer, India, Rajasthan\r\nshreenakodatirth@gmail.com\r\nshreenakodatirth.blogspot.in', '105', '19', '936', 'Nakoda ji is one of the famous Jain temple of India.This sacred tirtha is at a distance of 13 km from Balotara Railway station and 1 km from Mewad city. It is situated in the forest in the hills. In this tirtha with a charming natural atmosphere all-around, we have an idol of Mulnayaka Shri Parshvanath Bhagavan. It is black in complexion, 58 cm in height and in Padmasana posture. The idols is extremely charming and miraculous. The miracles of the presiding deity of this spot, Shri Bhairavaji Maharaj are well-known. We have a reference which states that the ancient name of Nakoda was Virampur. It is said that in the third century before the Vikrama era, two brothers, Shri Virasen and Shri Nakoresen raised two villages Virampur and Nakorenagar at a distance of twenty miles. They also get constructed two temples of Shri Chandraprabhu Bhagavan and Shri Suparshva Bhagavan.\r\nThe main idol is that of Shri Nakoda Parsvanatha. This statue was brought here from the village Nakoda which is near Sinduri., hence the place is called Nakoda Parsvanath temple. But this alone is not the attraction of the temple. The idol of Shri Nakoda Bheruji was installed by Acharya Shri Vijay Himachal Suri who also established idols of other Teerthankars in this temple.\r\nThis is a very ancient temple and the construction work has been going over the centuries. This place has become a pilgrimage that people from every religion visits here.The devotees believe that every particle of this wholly pilgrimage of Nakoda is sacred. This is a universal feeling that entry into the place is very pleasing. Elam and tranquility descends upon the visitor. A feeling of Divine bliss is around. This is also believed that who so ever is pays visit here, has his wishes fulfilled.Although the temple is very ancient one but from time to time renovations and repairs and additions have been made to the temple. So it is in a very sound position.The temple has about 246 inscriptions which amply show that over the centuries, the temple was extended, renovated, rebuilt and additions were made to it. Even today the construction work is continuing.', '2023-08-21 14:58:06', '2023-08-21 14:58:06', 0, 0, NULL, NULL, 15, 27),
(391, '/utilites_banner/1997737296download.jpeg', 'जैसलमेर तीर्थ', '02992252404', NULL, 'FORT TEMPLE', '105', '19', '451', 'JASALMER', '2023-08-21 15:05:17', '2023-08-21 15:06:32', 0, 0, NULL, '/utilites_banner/1796274037जैसलमेर में जैन मंदिर अवश्य देखें.pdf', 15, 27),
(392, NULL, 'श्री ब्रह्मसागर (ब्रह्मसर) तीर्थ', '02992252404', NULL, 'श्री दादा जिन कुशलसूरि ट्रस्ट श्री दादा जिन कुशलसूरि ट्रस्ट; स्थान: कुशलधाम; पद: ब्रह्मसार; जिला: जैसलमेर; राज्य: राजस्थान. भारत। टेलीफोन: (02992) 52171.', '105', '19', '937', 'श्वेतवर्णीय जगवल्लभ पार्श्वनाथ भगवान 75 सेमी ऊंचाई के पद्मासन मुद्रा में विराजमान हैं।सन् 1844 में माघ शुक्ल की अष्टमी तिथि। जैसलमेर पंचतेर्थी में से एक, यह पवित्र स्थान एक छोटे से गाँव, ब्रह्मसर में स्थित है। श्रेष्ठी श्री अमोलखचानजी माणकलालजी बागरेचा ने इस मंदिर का निर्माण कराया था और माघ के 8वें दिन, वि.सं. 1844 को इसकी प्रतिष्ठा की थी। इस मंदिर के पास बुद्ध काल का वैष्णव तीर्थ वैसाखी मौजूद है। इस गांव में दादागुरु जिनकुशलसूरिजी की दादावाड़ी की स्थापना डेरावूर गांव के लुनिया गोत्र के एक सेठ ने की थी, जो यवनों के डर से यहां आ गए थे। दादावाड़ी के अंदर का तालाब हर मौसम में पानी से भरा रहता है।यह तीर्थ स्थान जैसलमेर पंचतीर्थियों में गिना जाता है। जिनकुशल सूरीश्वरजी दादा वाडी इस तीर्थ मंदिर से 1.5 किलोमीटर की दूरी पर मौजूद है। दादा वाडी में एक कुंड भी मौजूद है, जिसके बारे में कहा जाता है कि यह भारी बारिश के दौरान भी पानी से भरा रहता है।लुनिया गोत्र से संबंधित अमोलखचंदजी  माणकलालजी बागरेचा ने इस तीर्थ मंदिर की स्थापना माघ शुक्ल 8, माघ शुक्ल 8, वि.सं. 1944 को की थी। ऐसा कहा जाता है कि वे पास के डेरौर गांव के निवासी थे। वह गाँव के यवनों से डरता था। उन्हें गुरुदेव श्री जिनकुशल सूरीश्वरजी ने राजस्थान की ओर प्रवास करने का सुझाव दिया था, लेकिन साथ ही उन्होंने उन्हें यात्रा करते समय पीछे मुड़कर न देखने की चेतावनी भी दी थी। उन्होंने अपना सारा सामान एक ऊँट पर रख कर राजस्थान की ओर प्रवास प्रारम्भ कर दिया। बीच रास्ते में रोशनी देखकर वह डर गया और पीछे मुड़कर देखा। उसने गुरुदेव को अपनी सुरक्षा के लिए अपने पीछे आते देखा। उसी समय, गुरुदेव उन्हें पास के ब्रह्मसर गाँव में जाने का संकेत देकर गायब हो गए। अमोलखचंदजी ने स्वयं ब्रह्मार गांव में दो को बसाया और जिन मंदिर का निर्माण कराया। उन्होंने उस स्थान पर दादावाड़ी का भी निर्माण किया जहां गुरुदेव ने उन्हें अंतिम निर्देश दिया था। उस पत्थर पर पैरों के निशान आज भी मौजूद हैं जिस पर खड़े होकर गुरुदेव अमोलखचंदजी को संकेत दे रहे थे। दादावाड़ी में एक कुंड भी मौजूद है और कहा जाता है कि यह पूरे दिन पानी से भरा रहता है।धर्मशाला में भोजनशाला की सुविधा के साथ 40 संलग्न कमरे और एक बड़ा हॉल है। नाश्ता सुबह 9.00 बजे और भोजन 11.00-2.00 के बीच और शाम 5.00 बजे से सूर्यास्त तक उपलब्ध कराया जाता है।', '2023-08-22 13:48:47', '2023-08-22 13:48:47', 0, 0, NULL, NULL, 15, 27),
(393, NULL, 'अमर सागर जैन मंदिर जैसलमेर', '02992-252405', NULL, 'Lodurva, Jaisalmer - 345001', '105', '19', '451', 'लोद्रवा के रास्ते केवल 6 किलोमीटर पर स्थित यह जगह महाराजा अमर सिहं ने एक जलाशय के रूप में 1688 में विकसित की थी। यह एक प्राकृतिक स्थान है । यहां के बांध बारिश का पानी रोकने के लिये बनवाये गये थे । अनेक पृष्ठभाग तैयार किये गये जिन पर गर्मी के दिनों के लिये महल मन्दिर तथा बगीचे विकसित किये गये। तालाब के दक्षिण में बड़ा ही खूबसूरत जैन मन्दिर है, जिसका निर्माण जैसलमेर के पटवा सेठ हिम्मत मल बाफना ने 1871 में बनवाया था । बाफना समाज के इतिहास कुछ इस तरह से बताया जाता है। परमार राजा पृथ्वीपाल के वशंज राजा जोबनपाल और राजकुमार सच्चीपाल ने कई युद्ध जीते जिसका श्रेय उन्होंने \'बहुफणा पार्श्वनाथ शत्रुंजय महा मन्त्र\' के लगातार उच्चारण को दिया।युद्ध जीतने के बाद उन्होंने जैन आचार्य दत्तसुरी जी से जैन धर्म की दीक्षा ली।उसके बाद से वे बहुफणा कहलाने लगे।  कालान्तर में बहुफणा, बहुफना, बाफना या बापना में बदल गया। बाफना समाज की कुलदेवी ओसियां की सच्चीय माता हैं। इसीलिए इनके मंदिरों में जैन तीर्थंकर के अतिरिक्त हिन्दू मूर्तियाँ भी स्थापित की जाती हैं।मंदिर में ज्यादातर जैसलमेर का पीला पत्थर इस्तेमाल किया गया है। पर साथ ही सफ़ेद संगमरमर और हल्का गुलाबी जोधपुरी पत्थर भी कहीं कहीं इस्तेमाल किया गया है।मंदिर के स्तम्भ, झऱोखे और छतों पर कमाल की नक्काशी है। जैसलमेर से मंदिर तक आने जाने के लिए आसानी से वाहन मिल जाते हैं।प्रवेश के लिए  शुल्क है और कैमरा शुल्क देकर फोटो भी ली जा सकती हैं. मंदिर सुबह से शाम तक खुला रहता है।', '2023-08-22 13:58:14', '2023-08-22 13:58:14', 0, 0, NULL, NULL, 15, 27),
(394, '/utilites_banner/172990730620220113_140756.jpg', 'लोद्र्वा तीर्थ', '02992250165', NULL, 'Lodurva, Baramsar With Baisakh, Rajasthan 345001', '105', '19', '920', '345001', '2023-08-22 14:02:41', '2023-08-22 14:02:41', 0, 0, NULL, NULL, 15, 27),
(395, '/utilites_banner/178821484817007_pokran.jpg', 'SHRI POKHRAN TIRTH', NULL, '02992252404', 'श्री जैसलमेर लोद्रवपुर पार्श्ववंत श्वेतांबर जैन ट्रस्ट जैन मंदिर\r\nपी.ओ. पोखरण - 345 021.\r\nजिला: जैसलमेर, राजस्थान।\r\nमुख्य पेढ़ी : जैसलमेर।', '105', '19', '938', 'सफेद रंग में श्री पार्श्वनाथ भगवान, कमल मुद्रा में विराजमान, ऊंचाई 75 सेमी, पोखरण (श्वे) गांव में एक मंदिर में स्थित है। \r\nइस तीर्थ की प्रतिष्ठा विक्रम वर्ष 1548 में की गई थी। जीर्णोद्धार के बाद विक्रम वर्ष 1883 में इसे एक बार फिर प्रतिष्ठित किया गया। यह तीर्थ जैसलमेर पंच तीर्थों में से एक है। लाल पत्थर से बनी इमारतों की नक्काशी देखने लायक है। इस मंदिर के पास ही दो अन्य मंदिर हैं तथा गांव के बाहर एक प्राचीन दादावाड़ी भी है। पोखरण का रेलवे स्टेशन मंदिर से एक किमी दूर है। मंदिरों के पास का रास्ता संकरा होने के कारण निजी कारों और बसों को भी मंदिर से 100 मीटर की दूरी पर पार्क करना पड़ता है। सार्वजनिक बस-स्टैंड 250 मीटर दूर है। यह तीर्थस्थल जोधपुर-जैसलमेर मार्ग पर स्थित है। जैसलमेर पोखरण से 40 किलोमीटर दूर है। मंदिर के पास ही ठहरने के लिए एक छोटी सी धर्मशाला है जहाँ पानी और बिजली दोनों उपलब्ध हैं।', '2023-08-22 14:09:46', '2023-08-22 14:09:46', 0, 0, NULL, NULL, 15, 27),
(396, '/utilites_banner/6075911532021-10-28.jpg', 'Bheru Bagh Parshvnath Jain Shvetamber Teerth Jodhpur', '029312430386', '029312730086', '1st Cross Rd, Sardarpura, Jodhpur, Rajasthan 342003', '105', '19', '449', 'jodhpur', '2023-08-22 14:15:58', '2023-08-22 14:15:58', 0, 0, NULL, NULL, 15, 27),
(397, '/utilites_banner/1895031160osian3.jpg', 'ओसिय जी तीर्थ', '02992274232', NULL, 'Shri Mangalsinhji Ratansinhji Dev Pedhi Trust, Osian : 342302, Dist. Jodhpur, Rajathan State, India.', '105', '19', '903', 'Mulnayak: Nearly 80 cms. high, Golden - Colored idol of Bhagawan Mahavir Swami in the admasana posture. Tirth: It is in the center of the Osiyaji village.Historicity: Once this was a large and prosperous city. In ancient times, it was known by many names. The inscription states that this temple was built by king Utpaldev and the idol was installed by Acharya Ratnapradhasurishvarji. In the ‘Osian Vir Stavan’ composed by Shri Nayapramod, the disciple of Hir Udaya in the year 1712 of the Vikram era, it is stated that this idol was installed by King Samprati. After lying in the hollow of the earth for centuries, when Uhad, the king’s advisor, settled. the city, Acharya Ratnaprabha surishvarji blessed this land by putting his foot - steps on it. There is a reference. that this temple was renovated and the idol was installed in it in the year 1017 of the Vikram era. It was renovated again and again from time to time. There is a famous and very miraculous idol of the presiding deity named. Puniya Baba and the ancient idols of a male snake and a female snake are also there. Acharya Ratnaprabhaji preached Chamundadevi and made her right - faithed (Samyaktvi) and adorned her with the name Sachchaimata. By her divine power, an idol of Bhagwan Mahavir was made of cow - milk and sand. This idol was installed by the Acharya as a Mulneyak. A fare is held here on the  Fagan Sud 3..Other Temples: There is a Dadawadi on the hill in the village, There are foot - idols of Acharya Ratnaprabha Surishvarji. There is also a temple of Sachaiamata at a distance of one kilometer.\r\nWorks of art and Sculpture: This is a tirth of religion as a well as tirth of From the viewpoint of art and sculpture, Osian world - famous on account of its vastness, artistic distinct quality and beauty. The pillars and walls of the pandal the scene of the celebration of bathing the idol by gods and goddesses, and the scene of carrying the fetus, look very vivid. The artistry of the gate to the temple and the arched gates to the round passage are very attractive. Researchers of archaeological skill and ancient sculpture, come here from the country and from abroad.Guidelines: The Osiyaji tirth is on the Jodhpur - Jesalmer railway line at a distance of one kilometer from the temple. Jodhpur is at a distance of 65 kilometers. There are boarding and lodging provisions.', '2023-08-22 14:20:37', '2023-08-22 14:20:37', 0, 0, NULL, NULL, 15, 27),
(398, '/utilites_banner/117975866084246_kaparda.jpg', 'श्री कपरदा तीर्थ', '02930263909', '0293063947', 'श्री जैन श्वेतांबर प्राचीन तीर्थ, कपरडा\r\nश्री आनंदजी कल्याणजी पेड़ी\r\nपोस्ट ऑफिस कपरडा - 342 605\r\nजिला: जोधपुर, राजस्थान', '105', '19', '453', 'श्री स्वयंभू (स्वयं निर्मित) पार्श्वनाथ भगवान कपरदा (श्वे) गांव के एक मंदिर में 55 सेमी ऊंचे चॉकलेट रंग के कमल आसन में विराजमान हैं।यह जानना मुश्किल है कि कपरदा गांव कब अस्तित्व में आया। ऐसा माना जाता है कि पुराने समय में इस गांव को करपरहेड़ाक, कालाधेड़ा आदि नामों से जाना जाता था। यहां की मूर्ति कुछ चमत्कारों के साथ विक्रम वर्ष 1674 में पौष कृष्ण 10 को, जो स्वयं भगवान की जयंती थी, प्रकट हुई थी। मूर्ति के नीचे एक शिलालेख है जिसमें कहा गया है कि विक्रम वर्ष 1678 में वैशाख शुक्ल पूर्णिमा को, इस मूर्ति को आचार्य श्री जिनचंद्रसूरिजी के हाथों चार मंजिला भव्य मंदिर में स्थापित किया गया था, जिसे वहां के शासक भानाजी भंडारी ने बनाने का निर्देश दिया था। जेटेरन।जब मंदिर के महान जीर्णोद्धारकर्ता, जैन संप्रदाय के प्रमुख आचार्य श्री नेमिसूरीश्वरजी यहां के दौरे पर आए, तो उन्हें खराब प्रबंधन के कारण मंदिर की अपवित्रता पर दुख हुआ। उन्होंने तुरंत मरम्मत शुरू कराई, सही उचित प्रबंधन किया और विक्रम वर्ष 1975 में महा शुक्ल वसंतपंचमी पर एक बार फिर पवित्रीकरण समारोह आयोजित किया। पहले इस चार मंजिला मंदिर में, श्री स्वयंभू पार्श्वनाथ भगवान की केवल एक मूर्ति थी, लेकिन इन समारोहों के समय अन्य 15 मूर्तियाँ जोड़ी गईं जो आचार्य श्री का एक उल्लेखनीय कार्य था।भदारी गोत्र के श्री भानाजी जोधपुर के राजा गजसिंह के शासनकाल के दौरान जेतेरण क्षेत्र के शासक थे। किसी कारण से एक बार जब राजा क्रोधित हो गए और उन्होंने श्री भंडारी को जोधपुर चलने का आदेश दिया, तो श्री भंडारीजी भयभीत होकर जोधपुर के लिए रवाना हो गए और रास्ते में कापरड़ा में रुक गए। भंडारीजी भगवान की मूर्ति के दर्शन किये बिना भोजन न करने का व्रत ले रहे थे। गाँव में पूछताछ करने पर उन्हें जानकारी मिली कि उपाश्रय में रहने वाले एक यतिजी के पास एक मूर्ति है। फिर भंडारीजी खुशी-खुशी श्री यतिजी के पास गए, मूर्ति के दर्शन किए और उसके बाद जोधपुर के रास्ते पर आगे बढ़ गए। भंडारीजी से जोधपुर जाने का कारण जानने पर यतिजी ने उन्हें चेतावनी दी कि यह उनकी परीक्षा की घड़ी है, इसलिए चाहे कुछ भी हो, उन्हें साहस रखना चाहिए। यतिजी ने उन्हें आश्वासन दिया कि वह निर्दोष हैं और राजा केवल आदर और सम्मान के साथ उनका स्वागत करेंगे। दूसरी ओर राजा एक झूठा ढकोसला और मनगढ़ंत व्यक्ति था। राजा ने पूछताछ की और भानाजी जोधपुर पहुँचे, राजा ने उन्हें उचित आदर-सत्कार दिया और पाँच सौ सिक्के भी भेंट किये।जेतेरन लौटते समय, भंडारीजी यतिजी से फिर मिले और उन्हें पूरी कहानी सुनाई, जहाँ से यतिजी ने उन्हें एक सुंदर मंदिर बनाने के लिए प्रेरित किया। भंडारीजी ने तुरंत पांच सौ सोने के सिक्कों की यह पूरी राशि दान कर दी और मंदिर की ऐसी परियोजना को क्रियान्वित करने पर हर संभव मदद करने का वादा किया। यतिजी ने ख़ुशी-ख़ुशी इन सिक्कों से भरा एक थैला पैक किया और थैले को पलटने से बचाने के निर्देशों के साथ कई गुना वृद्धि से संबंधित दिव्य मंत्रों से “वास-क्षेप” छिड़कने के बाद भंडारीजी को थैला वापस कर दिया। उन्होंने आगे वादा किया कि अगर थैला नहीं पलटा गया तो मंदिर की सारी जरूरतें पूरी कर दी जाएंगी.भण्डारीजी महान पुण्यात्मा थे और जो कुछ हुआ उससे वे प्रसन्न हो गये। भंडारीजी की इच्छा के अनुसार मंदिर के लिए डिज़ाइन स्केच और मानचित्र तैयार किए गए और निर्माण कार्य शुरू हो गया। उन्होंने अपने पुत्र श्री नरसिंह को इस परियोजना का प्रभारी नियुक्त किया। जब पूरा निर्माण कार्य पूरा होने वाला था, तब श्री नरसिंह को थैले के बारे में जानने की उत्सुकता हुई और उसे उसे पलटने की इच्छा हुई, जो उन्होंने किया और जैसे ही उन्होंने ऐसा किया, सारे सोने के सिक्के बाहर आ गए और थैला खाली हो गया। इस पर नृसिंह बहुत निराश हुए और उन्हें अत्यंत पश्चाताप हुआ। यतिजी को बताया गया कि क्या हुआ था और उन्होंने अधिक चिंता न करने की सलाह दी और भंडारीजी को कपरडा बुलाया। जब भण्डारीजी कपरडा गये तो यतिजी ने भण्डारीजी को पूरी स्थिति से अवगत कराया। मंदिर पूरा नहीं हुआ और भंडारीजी ने इस मामले में पूरी तरह असहाय महसूस करते हुए अपने कर्मों को दोष देना शुरू कर दिया। इससे अधिक कुछ नहीं किया जा सका. अंत में स्थापना और अभिषेक समारोह की तिथि तय की गई, और यह निर्णय लिया गया कि इस पवित्रीकरण के लिए, उनके आराध्य आचार्य श्री चंद्रसूरीश्वरजी, जो उस समय पाली में थे, को आमंत्रित किया जाना चाहिए। तदनुसार, अनुरोध न केवल समारोहों के लिए बल्कि मंदिर के लिए एक उपयुक्त मूर्ति खोजने के लिए भी किया गया था।\r\nविक्रम वर्ष 1674 में पौष कृष्ण 10 को, जो संयोग से प्रभु का जन्म कल्याणक दिवस था, विक्रम वर्ष 1678 में वैशाख के दिन \"बबूल के पेड़ों\" की झाड़ियों से प्रकट हुई प्रभु की मूर्ति को श्री भानाजी भंडारी द्वारा निर्मित नवनिर्मित मंदिर में समारोहपूर्वक स्थापित किया गया था। शुक्ल पूर्णिमा राजा श्री गजसिंहजी की उपस्थिति में आचार्य श्री जिनचंद्रसूरीश्वरजी के हाथों। भक्तों ने मूर्ति को स्वयंभू (स्वयं प्रकट) पार्श्वनाथ कहना शुरू कर दिया। इस मंदिर के शिखरों की चारों मंजिलों में चारों दिशाओं में मूर्ति स्थापित है। प्रत्येक वर्ष चैत्र शुक्ल पंचमी को यहाँ उत्सव मनाया जाता है।शिखर उसकी एक विशेषता है। यह लगभग 95 फीट ऊंचा है और इसे लगभग 8 किलोमीटर की दूरी से देखा जा सकता है। स्थापत्य शैली अद्वितीय है। हॉल में कई मूर्तियाँ हैं। गुंबद की छत, हॉल के खंभे और मंदिर के विभिन्न द्वारों और आंतरिक दरवाजों पर बने पत्थर के मेहराब सभी कला में अद्वितीय हैं। आसपास कोई दूसरा मंदिर नहीं है.यह तीर्थ सड़क मार्ग से बिलाड़ा से 25 किलोमीटर तथा जोधपुर से 50 किलोमीटर दूर है। इन सभी स्थानों से बसें और टैक्सियाँ उपलब्ध हैं। यह मंदिर जोधपुर-जयपुर मुख्य मार्ग पर स्थित है।', '2023-08-22 14:55:44', '2023-08-22 14:55:44', 0, 0, NULL, NULL, 15, 27),
