(401, NULL, 'नाडा तीर्थ', '02993245499', NULL, 'Shri Vardhman Anandji Jain Pedhi Shri Vardhman Anandji Jain Pedhi; At &amp; Post: Nada; Tehsil: Bali; Dist.: Pali; State: Rajasthan. INDIA.', '105', '19', '939', 'Shri Mahaveer Bhagwan, Swet Varn, Padmasanasth, about 1.22 mts (1.98 mts with Parikar).Jain God Desc	:Ancient templeJain Teerth	:It is said,\"Nada, Diyada, Nandiya; Jeevit swami vandiya.\" Inscriptions from the period of V.S. 1017 to V.S. 1659, shows that this temple was in damaged conditions for a long but the origin of Nada city is not described anywhere. The idol of the period of Bhagwan Mahaveer meight have been changed during renovation. The marking of its establishment by the honarary hands of Shri Shantisurishwarji on Saturday, the 9th day of Magh Krishna, V.S. 1505. This idol is also very effective.', '2023-08-22 15:12:35', '2023-08-22 15:12:59', 0, 0, NULL, NULL, 15, 27);
