(402, '/utilites_banner/185501373271325_dungarpur.jpg', 'डूंगरपुर तीर्थ', '02964233186', '02964233259', 'श्री आदिनाथ भगवान जैन श्वेतांबर मंदिर पेढ़ी, मानेकचौक\r\nपो.ओ. डूंगरपुर - 314001\r\nजिला: डूंगरपुर, राजस्थान', '105', '19', '444', 'श्री आदिनाथ भगवान डूंगरपुर के मानेकचौक क्षेत्र के एक मंदिर में स्थित धात्विक \"परिकर\" में 105 सेमी ऊंचे सफेद रंग के कमल आसन में विराजमान हैं। ( श्वे).ऐसा कहा जाता है कि विक्रम वर्ष 1526 में, इस मंदिर का निर्माण शेठ सांवलदास दावड़ा ने करवाया था और इसमें श्री आदिनाथ भगवान की एक बड़े आकार की धातु की मूर्ति स्थापित की गई थी और आचार्य श्री रत्नसूरिजी के शिष्यों श्री उदयवल्लभसूरिजी और श्री ज्ञानसागरसूरिजी के हाथों पवित्र किया गया था। मुस्लिम काल में मूर्ति को सोने की समझकर क्षतिग्रस्त कर दिया गया। इसलिए सफेद रंग की नई मूर्ति की प्राण-प्रतिष्ठा के बाद स्थापना की गई। हालाँकि धात्विक \"परिकर\" अभी भी बरकरार है जिस पर विक्रम वर्ष 1526 का एक शिलालेख है।\r\nमंदिर की विशेषता धातुई \"परिकर\" है जिसमें कुल 72 तीर्थंकरों की छवियां हैं - 24 अतीत, 24 वर्तमान और 24 भविष्य में। ऐसे फ्रेम वाली ऐसी ही मूर्ति दुनिया में कहीं और मिलना बेहद मुश्किल है। जिस पबासन पर भगवान विराजमान हैं वह भी धातु से बना है जिसमें 14 स्वप्न, 9 ग्रह, अष्टमंगल और यक्ष-यक्षिणियां देखी जा सकती हैं। इस मंदिर में 33 सेमी ऊंची श्री शांतिनाथ भगवान की एक मूर्ति भी है। स्फटिक पारदर्शी पत्थर से निर्मित और राजा संप्रति के काल के पांच धातुओं में ढले 34 जिनबिम्ब जो अत्यंत मनमोहक हैं।\r\nओसवाल राजवंश के बहादुर और बहादुर शेठ श्री शालाशा, राजा गोपीनाथ के मुख्यमंत्री और डूंगरपुर के सोमदास यहाँ रहते थे। स्थानीय \"भीलों\" को अपने अधीन कर शलाशा ने यहाँ विजय का जैन ध्वज लहराया था। वह न केवल बहादुर था, बल्कि धर्म प्रेमी और बहुत धर्मनिष्ठ भी था। उन्होंने विक्रम वर्ष 1312 में श्री पार्श्वनाथ भगवान का बहु-गुंबददार मंदिर बनवाया था जो आज पुराने घाटी मोहल्ले में मौजूद है। शालाशा के काल में डूंगरपुर एक बहुत बड़ा शहर था। तब जैन गृहस्थ परिवारों की संख्या 700 थी। वर्तमान में इसके अलावा छह मंदिर और हैं। यह तीर्थस्थल श्री केसरियाही से लगभग 42 किलोमीटर दूर है। अहमदाबाद-उदयपुर रोड पर भिचीवाड़ा से होकर पहुंचा जा सकता है, जहां बस और टैक्सियां ​​उपलब्ध हैं। डूंगरपुर का नजदीकी रेलवे स्टेशन 2 किलोमीटर दूर है। बस स्टैंड सिर्फ एक किमी दूर है.ठहरने के लिए पानी और बिजली की सुविधा सहित एक धर्मशाला है। पूर्व सूचना पर भोजन की व्यवस्था की जा सकती है।', '2023-08-22 15:17:24', '2023-08-22 15:17:24', 0, 0, NULL, NULL, 15, 27),
(403, '/utilites_banner/470248711AyadTirth-GanpatiNagar-Udaipur-16.jpeg', 'Shri Ayad Jain Tirth, Ayad, Ganpati Nagar, Udaipur', '0294-2421637', NULL, 'Ganpati Nagar, District : Udaipur, State : RAJASTHAN, Country : India, Pincode : 313001', '105', '19', '463', 'श्री जैन श्वेताम्बर महासभा के तत्वावधान में आयड़ तीर्थ स्थित श्री आदिनाथ, शान्तिनाथ, शंखेश्र्वर पार्श्वनाथ, महावीर स्वामी, सुपाश्र्वनाथ भगवान के पांच शिखरबद् जैन मंदिर है ।\r\nउदयपुर में आयड तीर्थ के नाम से प्रसिद्ध पांच जिनालयों में प्रतिष्ठित अधिकांश प्रतिमाएं महाराजा संप्रति कालीन है।\r\n1. श्री शंखेश्वर पार्श्वनाथ बावन जिनालय में मूलनायक प्रभु की प्रतिमा पर विक्रम संवत 1029 तथा आचार्य श्री यशोभद्रसूरीजी का नाम अंकित है। वर्तमान में मूलनायक के रूप में स्थापित श्री पार्श्वनाथ प्रभु की प्रतिमा भूगर्भ से प्राप्त हुई थी जिसकी प्रतिष्ठा विक्रम संवत 2058 में हुई।2. श्री शांतिनाथ मंदिर में श्री शांतिनाथ प्रभु की प्राचीन भूगर्भ से प्राप्त प्रतिमा प्रतिष्ठित है!\r\n3. श्री आदेश्वर मंदिर की प्रतिमा जी आचार्य सुहस्तिसूरिजी के हाथों प्रतिष्ठित है!4. वाडी में स्थित श्री महावीरस्वामी जिनालय की प्रतिमा भी संप्रतिकालीन है!5. श्री सुपार्श्वनाथ मंदिर 12 वीं सदी का है! इसमें भी भूगर्भ से प्राप्त प्राचीन प्रतिमा प्रतिष्ठित है!\r\n1) श्री सुपार्श्वनाथ भगवान का मंदिर यह मंदिर आयड तीर्थ परिसर से बाहर की ओर पश्चिम दिशा में स्थित है! यह शिखरबन्द विशाल देरासर जी 12वीं सदी का निर्मित है! यह मंदिर पूर्व में पार्श्वनाथ भगवान का था! इस मंदिर में निम्न प्रतिमाएँ स्थापित है:- श्री सुपार्श्वनाथ भगवान की प्रतिमा 23इंच ऊँची श्वेत पाषाण की है! परिकर की ऊँचाई 41इंच है! गर्भगृह से बाहर निकलते ही दाहिनी ओर कारनीश पर तीन चरण पादुका जी श्वेत पाषाण की वेदी पर प्रतिष्ठित है! बाहरी सभा मंडप से नीचे उतर कर बाईं ओर एक बड़ी देवरी में श्री पार्श्वनाथ प्रभु की प्रतिमा जी 31इंच श्याम पाषाण की प्रतिमाजी है!2) श्री महावीरस्वामीजी का मंदिर (आयड़ तीर्थ) महावीर स्वामी का मंदिर मूल रूप से वर्तमान आयड तीर्थ परिसर से बाहर है! गुंबजनुमा इस मंदिर में महावीर स्वामी की 17 इंच ऊंची श्वेत पाषाण की प्रतिमा जी है! इस वेदी के नीचे 7 इंच ऊंची श्याम पाषाण की चंद्रप्रभस्वामी की , पद्मावती माता मय मस्तक पर पार्श्वनाथ भगवान व नेमिनाथ भगवान की प्रतिमा है! इस पर कोई लेख व लांछन नहीं है! इसके साथ ही भैरव जी की प्रतिमा भी पृथक से विराजमान है!यह मंदिर एक वाडी (खेतीहर) में स्थित है! इस परिसर में महावीर स्वामी व चंद्रप्रभस्वामी की प्रतिमा जी भूमि से प्रकट हुई थी , जो करीब 2500 वर्ष प्राचीन है! इस मंदिर को श्री भेरुलाल जी दोशी ने बनवाया और प्रतिमा को संवत 1994 को आघाट नगर (खतरगच्छ) आयड में विराजमान करायी! यह मंदिर निजी मंदिर होने से विधि विधान द्वारा किसी श्रावक श्रेष्ठि द्वारा पूजा ना होने से आदेश्वर भगवान के मंदिर के पीछे अस्थायी मंदिर निर्माण करवाकर, महावीर भगवान की प्रतिमा स्थापित करायी गयी। इसको महावीर स्वामी का मंदिर कहा जाता है।3) श्री शांतिनाथ भगवान का मंदिर आयड मंदिर परिसर में मुख्य सडक के किनारे पर यह मंदिर स्थित है! यह मंदिर तिप्राचीन है व 12वी. सदी में इसका निर्माण हुआ था! मुलनायक श्री शांतिनाथ दादा की श्वेत पाषाण की प्रतिमा जी प्रतिष्ठित थी , जो अब पीछे महावीर स्वामी जिनालयजी में अस्थायी रुप से स्थापित की गयी है! इस पर कोई लेख नहीं है और परिकर भी 41इंच ऊँचा श्वेत पाषाण का है! गर्भगृह से बाहर निकलते समय दाहिनी ओर श्री सुमतिनाथ भगवान की श्वेत पाषाण की सुन्दर प्रतिमा जी है! बाईं ओर श्री आदिनाथ प्रभु की श्वेत पाषाण की प्यारी सी प्रतिमाजी है! सभा मंडप से बाहर निकलते समय दोनों ओर देवरियाँ बनी हुई है! बाईं ओर की देवरी में :- नागराज की साधारण श्याम पाषाण की प्रतिमा है! इसके ऊपर पार्श्वनाथ प्रभु की 6इंच ऊँची प्रतिमाजी की सं 2058 में प्रतिष्ठा करायी गयी हैं! श्याम नागराज की लंबाई करीब 21 फीट है और मोटाई करीब 9इंच है! नाग पंचमी के दिन श्वेत नागराज करीब 12 फीट लंबे प्रगट होते हैं! मंदिर में प्रवेश करते समय दाहिनी ओर देवरी में आचार्य श्री जगच्चन्द्रसूरिजी की 25इंच ऊँची श्वेत पाषाण की प्रतिमा जी है!\r\n4) श्री शंखेश्वर पार्श्वनाथ भगवान का देरासर जी:- इस देरासर मे प्रतिष्ठित पार्श्वनाथ भगवान की प्रतिमाजी की प्रतिष्ठा वि.सं. 1029 में आचार्य श्री यशोभद्र सूरिजी द्वारा की गयी हैं! उसको उत्थापित कर उसकी जगह पर शंखेश्वर पार्श्वनाथ प्रभु की 41इंच ऊँची श्वेतपाषाण की प्रतिमाजी विराजित की गयी , जिसका परिकर 69इंच ऊँचा है! यह प्रतिमाजी अतिप्राचीन है व खनन से प्राप्त हुई है! खनन से प्राप्त प्रतिमाजी को तपागच्छधिपति जयघोषसूरिश्वर जी के शिष्य जितेन्द्रसूरिश्वरजी और कुलचन्द्रसूरिश्वर जी की निश्रा में प्रतिष्ठा वि.सं.2058 फाल्गुन कृष्णा 13 को सम्पन्न हुई! मूलनायक प्रतिमाजी का परिकर , दरवाजा स्वर्ण रेखा से रेखांकित होने से सुन्दरता बढ गयी हैं!', '2023-08-22 15:24:55', '2023-08-22 15:24:55', 0, 0, NULL, NULL, 15, 27),
