(407, '/utilites_banner/1124967765download.jpeg', 'श्री करेड़ा  पार्श्वनाथजी जैन तीर्थ भूपालसागर', '7073224862', '01476224233', 'kareda tirth SHRI KAREDA PARSHWNATHJI TIRTH PEDHI BHUPALSAGAR DIST CHITODGADH BHOJANSALA ROOMS', '105', '19', '940', 'श्री करेड़ा पार्श्वनाथजी जैन तीर्थ भूपालसागर', '2023-08-22 15:40:45', '2023-08-22 15:40:45', 0, 0, NULL, NULL, 15, 27),
(408, '/utilites_banner/1396415341FalvradhiParshvnath-MertaRoad-Nagaur-12.jpg', 'मेड़ता तीर्थ', '01591276226', '01591252426', 'श्री पार्श्वनाथ भगवान पता: पोस्ट: मेड़ता रोड, जिला: नागौर 341510, राजस्थान\r\nनिकटतम रेलवे स्टेशन: मेड़ता रोड\r\nनिकटतम हवाई अड्डा: जोधपुर', '105', '19', '881', 'राजस्थान के मेड़ता शहर के बाहर स्थित इस मंदिर में श्री फलवृद्धि पार्श्वनाथ भगवान की 105 सेमी ऊंची मूर्ति है।\r\nएक किंवदंती के अनुसार, श्रेष्ठि धांडल नाम के एक चरवाहे के पास एक गाय थी जो दूध नहीं देती थी। जांच करने पर, चरवाहे ने पाया कि गाय के थन से दूध एक पेड़ के आधार के पास गिर रहा था। जल्द ही \'अधिष्ठायक देव\' धांडल के सपनों में प्रकट हुए और उन्हें उस स्थान पर 7 सिर वाले सांप के साथ श्री पार्श्वनाथ प्रभु की मूर्ति की तलाश करने का निर्देश दिया। उन्होंने वैसा ही किया जैसा उन्हें निर्देश दिया गया था और मूर्ति का पता लगाया गया था। \'अधिष्ठायक देव\' के निर्देश के अनुसार, श्रेष्ठि धांडल ने एक मंदिर बनाया और उसमें मूर्ति स्थापित की, जिसका अभिषेक समारोह पूज्य आचार्य धर्मघोषसूरिजी मा.सा. द्वारा किया गया था। इस मूर्ति की अनोखी विशेषता यह है कि यह मिट्टी और रेत से बनी है। ऐसा कहा जाता है कि सच्चे मन से भगवान की पूजा करने से मनोकामनाएं पूरी होती हैं। इस प्राचीन तीर्थ का उल्लेख \'विविध तीर्थ कल्प\' में भी किया गया है - जो 14वीं सदी के कवि जिनप्रभासूरिजी मा.सा. की रचना है। ऐसा माना जाता है कि सच्चे मन से भगवान की पूजा करने से मनोकामनाएं पूरी होती हैं। ऐसा माना जाता है कि इस मूर्ति के शुभ दर्शन से प्राप्त होने वाला पुण्य 68 तीर्थों के बराबर होता है और इसलिए इसका महत्व है।', '2023-08-23 09:39:25', '2023-08-23 09:39:25', 0, 0, NULL, NULL, 15, 27),
(409, '/utilites_banner/2013917510download.jpeg', 'श्री नागेश्वर पार्श्वनाथ श्वेताम्बर जैन तीर्थ', '07410240715', '07410240711', 'श्री जैन श्वेताम्बर नागेश्वर पार्श्वनाथ तीर्थ पेढ़ी\r\nपी.ओ. उन्हेल, सेंट चौमहला, पश्चिम रेलवे,\r\nजिला झालावाड, राजस्थान - 326515\r\nदूरभाष: +91-07410-240712/240747 फैक्स: 240716\r\nनागेश्वर तीर्थ पेढ़ी सेल नंबर: +91-9784816711 / +91-9649116711 धर्मशाला कार्यालय नंबर: +91-9784816711\r\nफैक्स: +91-07410-240716 धर्मशाला बुकिंग नंबर: +91-07410-240711 / 240781 धर्मशाला बुकिंग सेल नंबर: +91-7568558711 / +91-9610451711 \r\nईमेल :info@nageshwartirth.org /', '105', '19', '941', 'श्री नागेश्वर पार्श्वनाथ जैन मंदिर मध्य प्रदेश और राजस्थान राज्य की सीमा पर स्थित है। श्री नागेश्वर पार्श्वनाथ जैन तीर्थ का प्राचीन नाम वीरमपुर है। इस प्राचीन मंदिर का निर्माण लगभग 1200-1300 साल पहले किया गया था। मंदिर का जीर्णोद्धार 1207 (वीएस 1264) में जैन आचार्य श्री अभय देवसूरी द्वारा किया गया था। यह मंदिर श्वेतांबर संप्रदाय का है। जैन धर्म का. यह देहरासर सफेद संगमरमर से बना है और बहुत चमत्कारी माना जाता है।हरा रंग (भगवान पार्श्वनाथ के रंग के अनुसार)।\r\n  खड़े होकर कौसाग आसन  प्रतिमाजी के विभिन्न भागों का आयाम शरीर के अंग की चौड़ाई (इंच) ऊंचाई/लंबाई इंच     \r\nपद्मासन धर्मचक्र 8 ऊंचाई 15 फुट 8 लंबाई 15 घुटने से पैर की लंबाई 35 कमर से घुटने तक की लंबाई 41 वक्षस्थल 38 लंबाई 15 भुजाओं की लंबाई के बीच का अंतर 43 भुजाएँ 8 लंबाई 25 हाथ 6 लंबाई 35 गले से नाभि तक लंबाई 35 चेहरा 27 लंबाई 30 भामंडल 36 लंबाई 32 फेस 52 के ऊपर फना लंबाई 19 सिखा और फ़ना के बीच अंतर लंबाई 6 भगवान नागेश्वर पार्श्वनाथ के मस्तक पर सात फणा छत्र है। फना के चतरो सहित कुल ऊंचाई 14 फुट है। बिना फना शरीर की ऊंचाई 13.5 फुट यानी नौ हाथ है जो श्री पार्श्वनाथ भगवान की वास्तविक ऊंचाई है।', '2023-08-23 09:51:32', '2023-08-23 09:51:32', 0, 0, NULL, NULL, 15, 27),
(410, NULL, 'गुरुपुष्कर धाम गोगुन्दा', '9426113248', '9166521138', 'NH 27, Semtal gogunda rajasthan', '105', '19', '942', 'rorunda', '2023-08-23 09:56:27', '2023-08-23 09:56:27', 0, 0, NULL, NULL, 15, 27),
(411, '/utilites_banner/50307223969714_bali.jpg', 'बाली तीर्थ', NULL, '02938222029', 'Shri Manmohan Parshvanath Jain Devasthan Pedhi Parshvanath Chowk P.O. Bali – 306 701', '105', '19', '696', 'This is a very ancient shrine, It is said that this place was at first under the authority of Chouhan kings, there after it remained under the authority of Sonagara Chief of Jalore until it came to be ruled by the kings of Mewad.On the idol of Sri Parshvanath Bhagwan which is mind-capturing, there appears an inscription dated Jyest Krishna 6 of Vikram year 1161. This idol was discovered from a pond in village of Sela which is 3 Kms away from Bali. It is believed that the idol was installed and ceremonially consecrated at the hands of Acharya Sri Yashobhadrasurishvarji of Sanderak Gachchha. The temple was repaired and renovated about 300 years ago and the idol again installed and consecrated ceremonially. This temple was recently renovated again approx, about 20 years ago.\r\nThe idol works miracles. IT is believed that the Guradian Deity had appeared personally in a dream of a householder Jain named Sri Gemaji and had informed him that in the pond of village Sela two miles away from there was an ancient miracle working idol of Sri Parshvaprabhu which should be brought and installed here in Bali. On the basis of this dream, while digging was going on, this majestic idol did appear at the indicated spot. The Jain householders of Sela desired that the idol should be installed in their village. However after arguments, it was agreed and decided that the idol should be installed at the place where the bullock-cart carrying the idol would lead to. The bullock –cart led the idol to Bali and accordingly after building this magnificent temple, the idol was ceremonially installed with great festival in the village of Bali. The idol of the Lord is very pleasing and inspiring. The architecture of the temple is also unique and beautiful. In the temple of Sri Adishvar Bhagwan, the idol of Rata Mahavir is very beautiful and pleasing to see.', '2023-08-23 10:10:43', '2023-08-23 10:10:43', 0, 0, NULL, NULL, 15, 27),
(412, '/utilites_banner/1709319636Vimalnath-Desuri-Pali-11.jpeg', 'Shri Vimalnath Jain Shwetamber Mandir, Desuri, District - Pali (Rajasthan)', '02934254140', NULL, 'Address: Shri Vimalnath Jain Shwetamber Mandir, Desuri, District - Pali (Rajasthan)', '105', '19', '649', 'अरावली पर्वत की तराई में हरियाली से भरपूर नोमा व सुखडी नदी या बडी नदी के मध्य व जोधपुर उदयपुर मेगा हाईवे क्र. १६ की मुख्य सडक पर स्थित है देसुरी अर्थात प्राचीन देवसुरी नगर। मारवाड व मेवाड को जोडने वाला ऐतिहासिक गावं ,वीरों व संतों का गांव, जोधपुर डिवीजन व पाली जिले में गोडवाड का प्रथम गांव देवसुरी इतिहास प्रसिद्ध राठौड व राणाओं का आधिपत्यवाला गांव रहा।\r\nदेसुरी गांव का नाम ‘देवसुरी’ था, जिसका प्रमाण जैन पेढी पर अंकित है। ‘श्री ॠषभदेव भगवान जैन पेढी देवसुरी एवं पंचायत भवन’ नाम था। भगवान के तिगडे पर भी लेख में देवसुरी गांव अंकित है। कालक्रम में यह अपभ्रंश होकर देसुरी हो गया।  यहां कुल चार जैन मंदिर हैं। सभी संप्रतिकालीन हैं।\r\nश्री विमलनाथ मंदिर : देरों की वास में प्रभु शांतिनाथजी मंदिर व श्री पोरवाल जैन संघ, देसुरी पेढी के ठीक सामने जीर्णोद्धारित नूतन जिन मंदिर में श्री विमलनाथ प्रभु की सुंदर परिकर सह मनमोहक प्रतिमा विराजमान है। जैन तीर्थ सर्वसंग्रह के अनुसार, वि. स. १९५५ के लगभग, मूलनायक श्री चिंतामणि पाशर्वनाथ प्रभु की प्रतिमा इस जिनालय में विराजमान थी, जो वर्तमान में प्राचीन तिगडे सह रंगमंडप के एक देहरी में प्रतिष्ठित है। वि. स. २०११ (वीर स. २४८१) के माघ सुदि १० को आ. श्री जिनेन्द्रसूरिजी ने संपूर्ण जीर्णोद्धार करवा के नूतन मंदिर की प्रतिष्ठा की थी व मूलनायक के रूप में प्रभु श्री विमलनाथजी को विराजमान किया। स. २०६६ में दीक्षादानेश्वरी आ. श्री गुणरत्नसूरिजी की प्रेरणा पाकर श्री संघ ने जिनालय का सामूल जीर्णोद्धार करवाकर वि. स. २०६९ के वैशाख सुदि ६ गुरुवार दि. १६.०५.२०१३को भव्य महोत्सव पूर्वक अंजनशलाका प्रतिष्ठा संपन्न करवाई। इसके पूर्व में स. २०६६ जेठ वदि १ दि. २८.०५.२०१० को भूमिपूजन तथा आषाढ वदि ६, शुक्रवार, दि. २.७.२०१० को शिलान्यास संपन्न हुआ था। मंदिर के ठीक सामने पेढी व भोजनशाला व आयंबिल भवन है, जिसका वहीवाट श्री पोरवाल जैन संघ पेढी देखती है।', '2023-08-23 10:14:50', '2023-08-23 10:14:50', 0, 0, NULL, NULL, 15, 27),
(413, NULL, 'मांडोली तीर्थ', '02969233050', NULL, 'Shree Mandoli Tirth :Mandoli is a village in Jalore district of Rajasthan state in India. It is known mainly for the Jain temple dedicated to Guru Shantivijay Surishwarji.', '105', '19', '943', 'MANDOLI', '2023-08-23 10:26:27', '2023-08-23 10:26:27', 0, 0, NULL, '/utilites_banner/129975760मांडोली तीर्थ.pdf', 15, 27),
(414, NULL, 'श्री नांदिया तीर्थ, सिरोही, राजस्थान', '02971233416', NULL, 'Address: Shri Nandiya Jain Tirth, Jivit Mahaveer Swami Jain Tirth, Nandiya, District - Sirohi (Rajasthan)', '105', '19', '944', 'महावीर भगवान भगवान् महावीर के बड़े भाई नन्दिवर्धन के द्वारा बसाये जाने के कारण इस तीर्थ को नंदीग्राम से जाना जाता था। भगवान् के जीवन काल में ही प्रतिष्ठित हुई, इसलिए जीवंत महावीर स्वामी के नाम से भी जाना जाता है।\r\nभगवान महावीर स्वामी की विशाल प्रतिमाजी है। बताया जाता है कि नंदिग्राम नंदिवर्धनपुर नंदिपुर आदि प्राचीन नाम से प्रसिद्ध गाँव तीर्थंकर महावीर के ज्येष्ठभ्राता नंदिवर्धन ने बसाया। एक कहावत प्रसिद्ध है *नाणा, दियाणा नांदिया, जीवित स्वामी जुहांरिया* अर्थात है।\r\nमंदिर का निर्माण तीर्थंकर महावीर के जीवनकाल मे हुआ था। इसका पूर्वनाम नंदियक चैत्य था। तीर्थंकर महावीर स्वामी द्वारा चंडकौशिक नाग को यहाँ प्रतिबोधित किया था। मंदिर के मूल नायक तीर्थंकर महावीर हैं। निर्वाण काल श्री वीर निर्वाण संवत 2540 वर्ष से पूर्व का है।', '2023-08-23 10:30:23', '2023-08-23 10:30:23', 0, 0, NULL, NULL, 15, 27),
