(418, '/utilites_banner/15208135768035_Sri-Mandar-Tirth.jpg', 'मन्डार तीर्थ', '-02975236131', NULL, 'श्री पंच महाजन जैन धर्मदा एवं धार्मिक ट्रस्ट भंडार\r\nपी.ओ. मंदार - 307513\r\nजिला: सिरोही, राजस्थान।\r\nफ़ोन: 02975 – 36131', '105', '19', '835', 'मंदार गांव में मंदिर शेरी के एक मंदिर में सफेद रंग में श्री महावीर भगवान, कमल मुद्रा में बैठे हैं और ऊंचाई 120 सेमी है।प्राचीनता और प्रमुख विशेषताएं: प्राचीन शिलालेखों में इस स्थान को महारुद या महाहद कहा गया है। महान प्रकांड विद्वान आचार्य श्री वादीदेवसूरीश्वरजी दोनों विक्रम वर्ष 1143 में इस गांव में थे। विक्रम वर्ष 1287 में अबू-दिलवाड़ा के लावण्यवसही मंदिर के वार्षिक उत्सव को मनाने के लिए गठित समिति में इस गांव का नाम भी शामिल है। विक्रम वर्ष 1499 के कवि श्री मेघ की रचना तीर्थमाला में यहां विद्यमान श्री महावीर भगवान के मंदिर का उल्लेख है। ऐसा प्रतीत होता है कि यह मंदिर किसी समय भूकंप के झटकों के दौरान दब गया था। मौजूदा इष्टदेव श्री महावीर भगवान की बड़े आकार की मूर्ति और दो अन्य मूर्तियाँ श्री पार्श्वनाथ भगवान और श्री विमलनाथ भगवान की ध्यान मुद्रा में खड़ी मुद्रा में (श्री विमलनाथ भगवान की मूर्ति पर विक्रम वर्ष 1259 के एक शिलालेख के साथ) एक के पास भूमिगत से खोजी गई थीं। गांव के बाहर पहाड़ी. संभवतः यह श्री महावीर भगवान की वही मूर्ति है जिसका उल्लेख कवि मेघ ने अपनी तीर्थमाला में किया है। विक्रम संवत 1920 में एक बार फिर यहां मंदिर का निर्माण कर इस प्राचीन स्वर्गीय मूर्ति की समारोहपूर्वक प्राण-प्रतिष्ठा कर स्थापना की गयी। \r\nमहरीद गच्छ की स्थापना इसी स्थान पर हुई थी। गाँव के बाहर बिखरे पड़े असंख्य खंडहरों से ऐसा लगता है जैसे इस बड़े शहर में असंख्य जैन मंदिर हों। ऐसा लगता है जैसे इस बड़े शहर में असंख्य जैन मंदिर हों। स्थानीय श्रेष्ठियों द्वारा समय-समय पर गांव के बाहर कई धार्मिक अवसरों में भाग लेने के संदर्भ उपलब्ध हैं।\r\nहर साल माघ शुक्ल 13 को यहां शिखर मंदिर के शिखर पर ध्वजा फहराई जाती है।खुदाई के परिणामस्वरूप भूमिगत से प्राप्त मुख्य देवता की मूर्ति के साथ-साथ श्री पार्श्वनाथ भगवान और श्री विमलनाथ भगवान की ध्यान मुद्रा में खड़ी हुई सभी मूर्तियाँ न केवल आकर्षक हैं बल्कि बहुत ही अभिव्यंजक और प्रभावशाली हैं। इस मंदिर के अलावा, यहां आसपास के क्षेत्र में श्री धर्मनाथ भगवान का एक और प्राचीन मंदिर है।\r\nआबू रोड का नजदीकी रेलवे स्टेशन 50 किलोमीटर दूर है जहाँ टैक्सियाँ और बसें उपलब्ध हैं। यहां सिरोही, डीसा और आबू रोड से सीधी बसें आती हैं। मंदिर से बस स्टैंड केवल 200 मीटर की दूरी पर है। मंदिर तक बसें और कारें जा सकती हैं। ठहरने के लिए केवल एक उपाश्रय है जहां पानी और बिजली उपलब्ध है। एक आयंबिलशाला भी उपलब्ध है।', '2023-08-23 10:47:23', '2023-08-23 10:47:23', 0, 0, NULL, NULL, 15, 27),
