(420, '/utilites_banner/765495292significance.jpg', 'पावापुरी तीर्थ', '02972286814', '02972286866', 'Shree Pavapuri Tirth - Jeev Maitridham\r\nDelhi - Kandla Highway, N.H. 168 and S.H.27 Post - Krishnaganj, Sirohi, Rajasthan 307001', '105', '19', '461', 'The KP Sanghvi Group has always cared deeply about religion, culture, and society. This empathic and caring aspect was the very basis on which the Pavapuri Temple was founded. Pavapuri is a holy and sacred spot that stands on the roots of religious values, spiritual principles, and devotion towards the Divine. The KP Sanghvi Group’s devotion and dedication is what made this dream turn to reality. Centuries-old traditions and rituals are alive and breathing today in Pavapuri, and the history of Jainism is carefully preserved and enshrined in the name of Shree Pavapuri Tirth-JeevMaitridham Shree Pavapuri Tirth-JeevMaitridham is situated in the Sirohi district of Rajasthan in northwestern India. Rajasthan was known as the land of wars and brave warriors but this changed when Jain saints came to Rajasthan preaching peace and non- violence. Ahimsa (non-violence) is the fundamental principle forming the cornerstone of Jainism’s ethics and doctrine.\r\nShree Pavapuri Tirth-JeevMaitridham was founded by the KP Sanghvi Group in order to offer devotees the opportunity to find peace within themselves, comfort those seeking divine interventions in their lives, contribute to the welfare of society, and to ultimately serve all living beings.\r\nA shining example of Jain temples, art, architecture, and culture, this complex leaves visitors enthralled and enshrined in the pure values that have percolated through its temples through generations.\r\n\r\nThe blissful and therapeutic state of mind and peace experienced in Pavapuri cannot be put into words as it can only be felt deep within one’s soul. The calm, beautiful, scenic, and vast complex of Pavapuri sits ensconced amidst the contemplative Aravali Mountain range just like a pearl shining bright on the ocean bed.', '2023-08-23 10:54:20', '2023-08-23 10:54:20', 0, 0, NULL, NULL, 15, 27),
(421, NULL, 'अंचलगढ़ तीर्थ', '02974224122', NULL, 'Shri Aadinath Bhagwan\r\nPost : Achalgarh, District : Sirohi 307001, Rajasthan Nearest Railway Station Abu Road \r\nDistance 35.4 km Nearest Airport Udaipur \r\nDistance 184 km', '105', '19', '945', 'The climb through the steps of Achalgarh fort takes you to the entrance to the Jain temple before the very top of the steps. A sense of serenity envelops the courtyard, with its white marble pillars and carved sculptures. From the courtyard a few more steps will take you to the shrine. The main idol weighs several tons and is made of Panchloha. The temple is a “chaumukhi”, with an idol facing all four cardinal directions. There is a second set of\r\nchaumukhi idols above the main shrine, accessed by yet another short flight of steps.', '2023-08-23 10:59:45', '2023-08-23 10:59:45', 0, 0, NULL, NULL, 15, 27),
