(424, NULL, 'AMIJARA PARSHWNATH JAIN TIRTH', '9977028880', '07296261495', 'POST AMIJHARA MADHAYPRADESH The teerth place is 35 Kms from Dhaar & 59 Kms from Indore. Buses and taxis are available from both the places. The Koltar road leads upto the temple.', '105', '11', '947', 'Mulnayak: Nearly 135 cms. high white-coloured idol of Bhagwan Amijhara Parshvanath in thePadmasana posture. There is an umbrella of 9 hoods over the head of the idol.\r\nTirth: It is in the centre of the Amijhara village.\r\nHistoricity: The ancient name of the Amijhara Tirth was Kundanpur. Under the auspices ofAcharya Vijaysomsurishvarji, this splendid and miraculous idol was installed in the year 1548 of theVikram era. Since much nectar (Ami) was oozing out of the idol of Parshvanath Bhagwan, peoplebegan to call this idol by the name of Amijhara Parshvanath. When Kundanpur village came intothe domain of King Sandhiya, impressed by the miracles of this idol, the king named this village asAmijhara.\r\nOther Temples: There are no other temples.\r\nWorks of art and Sculpture: The nine-hooded idol is artistic and beautiful. This idol of AmijharaParshvanath is very miraculous, splendid and lustrous. Devotees come here and worship withgreat faith and devotion.\r\nGuidelines: The nearest railway station of Indore is at a distance of 88 kms. The nearest town ofDhar is at a distance of 32 kms. and Mohankheda is at a distance of 25 kms. from here. Busservices and private vehicles are available here. Dharamshala and Bhojanshala facilities areavailable here. There is an Upashraya also here.\r\nTrust: Shri Amijhara Parshvanath Shwetambar Jain Mandir, Post: Amijhara – 454 441, District:Dhar, State: Madhya Pradesh, India.', '2023-08-23 11:13:27', '2023-08-23 11:13:27', 0, 0, NULL, NULL, 15, 27),
