(659, NULL, 'श्री रसिकलाल माणिकचंद धारीवाल कैंसर हॉस्पिटल\" वलसाड', '06354514539', '08141880808', 'Valsad Surat Highway', '105', '5', '149', 'सूरत, गुजरात से मुम्बई के राजमार्ग पर सूरत से ७८ किलोमीटर  वलसाड से 16 km ( सुरतकी तरफ)  पर वाघलधारा गाँव है । राइट हेंड साइड पर आपको \"श्री प्रभव हेम कामधेनु गीरीविहार ट्रस्ट, पालीताणा\" संचालित \"श्री रसिकलाल माणिकचंद धारीवाल कैंसर हॉस्पिटल\" की कमान दिखाई देगी । हजारो चोरस मिटर मै फैला फल, फूल, खेत से हराभरा ये संकुल कोई आश्रम से कम नही। यहाँ अति सुंदर  जैन मंदिर एवं विशाल भोजन शाला भी है । ऒंर यहां की गौंशाला में करीब 400  देशी गाय है । यहां कैंसर के मरीज़ (दर्दी) एवं एक साथी को 10 दिन उपचार एवं ट्रेनिंग के लिए रखा जाता है । 80 बेड उपलब्ध है।  नास्ता, लंच और डिनर के समय दर्दी से मिल सकते है।सुबह ९ बजे आपको सिर्फ ५० रुपये मे केस निकलवाना है । अपने साथ मरीज़ (दर्दी) की केस फाइल एवं अगर ऑपरेशन, केमो करवाई हो तो वो साथ ले जानी है । सुबह १०.३० से १२.३० और दोपहर ३.३० से ५.३० दरमियान डॉक्टर द्वारा दर्दी की जांच के बाद १० दिन के लिए एडमिट किया जाता है । केवल दर्दी एवं एक साथी को ही प्रवेश की अनुमति है। ऐसी स्थिति में दर्दी को बिलकुल मुफ्त एवं साथी को ११ दिन के लिए केवल ३३ रुपये में रोज सुबह नास्ता, लंच एवं डीनर के लिए ३३ कूपन दीये जाते है, बस और कोई खर्च नहीं । रुपये १००० की डिपॉज़िट देनी होती है जो ११वें दिन रसीद दिखाने पर वापस मिल जाती है ( १० दिन से पहले निकलने पर डिपॉज़िट वापस नही मिलती )।सुबह ५.३० बजे योग, प्राणायाम, ७ बजे गाय के गोबर, गौमुत्र, गाय का दुध, दही, घी से बना पंचगव्य मिश्रण, ८ से ९ बजे के बीच नास्ता,९ बजे गौमुत्र के साथ आयुर्वेदिक टेबलेटस,\r\n९ से १० शरीर के कैंसरग्रस्त भाग मे गोबर, गौमुत्र का लेप लगाकर धूप मे बैठना,\r\n१० बजे काढा ( उकाळा),\r\n११ से १ बज के बीच लंच, लंच के बाद आयुर्वेदिक टेबलेटस,\r\n२ से ३ बजे सभाग्रुह में दर्दी के खानपान एवं उपचार के लिए सवाल जवाब, चर्चा, \r\n३.३० बजे काढा (उकाळा), \r\n५ से ६ बजे के बीच सायंकाल भोजन, उसके बाद आयुर्वेदिक टेबलेटस, \r\n८ बजे से ९.३० बजे तक सत्संग, कीर्तन, और बाद में दर्दी को दूध, \r\nयही दिनचर्या १० दिन जारी रहेगी । ११वें दिन आप १ महिने की दवाई (करीब २५०० से ४००० रुपएकी) लेकर अपने घर लौट सकते है, और घर पर ठीक यहाँ की तराह कम से कम एक साल बताये गये परहेज के साथ उपचार करना है । महीने, दो महीने पर दवाइयाँ लेने जाना है ।\r\nअहम ध्यानाकर्षित बाते :-', '2023-08-25 11:10:08', '2023-08-25 11:10:08', 0, 0, NULL, NULL, 19, 47),
